INSERT INTO `m_materi` VALUES (44, 149, 141, 3, 'Pengenalan Sosiologi', '<p><strong>Kelompok sosial</strong>&nbsp;merupakan sekumpulan individu dengan karakteristik tertentu dan kesamaan identitas yang saling berinteraksi bersama serta memiliki kesadaran kolektif sebagai satu kesatuan.</p>\n\n<p>Selengkapnya, silakan buka file PDF UKBM.</p>\n', 1, 0, 'https://www.youtube.com/embed/2YrPsXRWWHk', 'https://www.youtube.com/watch?v=2YrPsXRWWHk', 0, '15-07-2020-1594772632-UKBM_1_Sosiologi_XI_Sems_1.pdf', NULL, 1, 1, 0);
INSERT INTO `m_materi` VALUES (45, 147, 140, 3, 'PERUBAHAN SOSIAL', '<h2>Definisi[<a href=\"https://id.wikipedia.org/w/index.php?title=Perubahan_sosial&amp;veaction=edit&amp;section=1\">sunting</a>&nbsp;|&nbsp;<a href=\"https://id.wikipedia.org/w/index.php?title=Perubahan_sosial&amp;action=edit&amp;section=1\">sunting sumber</a>]</h2>\n\n<p>Definisi dan pengertian tentang perubahan sosial menurut para ahli diantaranya adalah sebagai berikut:<a href=\"https://id.wikipedia.org/wiki/Perubahan_sosial#cite_note-3\">[3]</a></p>\n\n<p>Gillin</p>\n\n<p><em>Perubahan sosial adalah perubahan yang terjadi sebagai suatu variasi dari cara hidup yang telah diterima karena adanya perubahan kondisi&nbsp;<a href=\"https://id.wikipedia.org/wiki/Geografi\">geografi</a>,&nbsp;<a href=\"https://id.wikipedia.org/w/index.php?title=Kebudayaan_material&amp;action=edit&amp;redlink=1\">kebudayaan material</a>, komposisi&nbsp;<a href=\"https://id.wikipedia.org/wiki/Penduduk\">penduduk</a>,&nbsp;<a href=\"https://id.wikipedia.org/wiki/Ideologi\">ideologi</a>, maupun adanya&nbsp;<a href=\"https://id.wikipedia.org/wiki/Difusi\">difusi</a>&nbsp;atau penemuan-penemuan baru dalam masyarakat.</em></p>\n\n<p>Emile Durkheim</p>\n\n<p><em>Perubahan sosial terjadi sebagai hasil dari faktor-faktor ekologis dan demografis, yang mengubah kehidupan masyarakat dari kondisi tradisional yang diikat solidaritas mekanistik, ke dalam kondisi masyarakat modern yang diikat oleh solidaritas organistik.</em></p>\n\n<p>Kingsley Davis</p>\n\n<p><em>Perubahan sosial merupakan perubahan-perubahan yang terjadi dalam&nbsp;<a href=\"https://id.wikipedia.org/wiki/Struktur\">struktur</a>&nbsp;dan fungsi masyarakat<a href=\"https://id.wikipedia.org/wiki/Perubahan_sosial#cite_note-Abdulsyani-1\">[1]</a></em></p>\n\n<p>Mac Iver</p>\n\n<p><em>Perubahan sosial adalah perubahan-perubahan yang terjadi dalam hubungan sosial (social relation) atau perubahan terhadap keseimbangan (ekuilibrium) hubungan sosial</em></p>\n\n<p>William F. Ogburn</p>\n\n<p><em>Perubahan sosial adalah perubahan yang mencakup unsur-unsur kebudayaan baik material maupun immaterial yang menekankan adanya pengaruh besar dari unsur-unsur kebudayaan material terhadap unsur-unsur immaterial</em></p>\n\n<p>Raja</p>\n\n<p><em>Perubahan sosial adalah segala perubahan pada lembaga kemasyarakatan di dalam suatu masyarakat yang memengaruhi suatu sistem sosial.</em></p>\n\n<p>Tidak semua gejala-gejala sosial yang mengakibatkan perubahan dapat dikatakan sebagai perubahan sosial, gejala yang dapat mengakibatkan perubahan sosial memiliki ciri-ciri antara lain:<a href=\"https://id.wikipedia.org/wiki/Perubahan_sosial#cite_note-4\">[4]</a></p>\n\n<ol>\n	<li>Setiap masyarakat tidak akan berhenti berkembang karena mereka mengalami perubahan baik lambat maupun cepat.</li>\n	<li>Perubahan yang terjadi pada&nbsp;<a href=\"https://id.wikipedia.org/wiki/Lembaga\">lembaga</a>&nbsp;kemasyarakatan tertentu akan diikuti dengan perubahan pada lembaga-<a href=\"https://id.wikipedia.org/wiki/Lembaga_sosial\">lembaga sosial</a>&nbsp;lainnya.</li>\n	<li>Perubahan sosial yang cepat dapat mengakibatkan terjadinya disorganisasi yang bersifat sementara sebagai proses penyesuaian diri.</li>\n	<li>Perubahan tidak dibatasi oleh bidang kebendaan atau bidang&nbsp;<a href=\"https://id.wikipedia.org/wiki/Spiritual\">spiritual</a>&nbsp;karena keduanya memiliki hubungan timbal balik yang kuat.</li>\n</ol>\n', 1, 0, 'https://www.youtube.com/embed/YZWs4beCsRw', 'https://www.youtube.com/watch?v=YZWs4beCsRw', 0, NULL, NULL, 1, 0, 0);
INSERT INTO `m_materi` VALUES (46, 128, 125, 3, 'DINAMIKA ROTASI', '<p>Penyelesaian : Diketahui : k = 200 N/m, m = 4 kg Ax = 5 cm. Jawab : a. Dari informasi di atas maka kita bisa mengetahui amplitudo osilasi&nbsp;</p>\n\n<p>adalah 5 cm&nbsp;</p>\n\n<p>Frekuensi sudut osilasi adalah 7,1 rad/detik. Hati-hati dengan satuan. Satuan sudut tidak dalam derajat tetapi dalam radian.&nbsp;</p>\n\n<p>b. Frekuensi osilasi pegas&nbsp;</p>\n\n<p>=(7,1/2p)= 1,1 Hz&nbsp;</p>\n\n<p>c. Keadaan awal pegas adalah diregangkan, maka fungsi posisi adalah&nbsp;</p>\n\n<p>fungsi cosinus. Posisi pegas setiap saat adalah x = 0,05 cos(7,1) m&nbsp;</p>\n\n<p>d. Periode osilasi adalah&nbsp;</p>\n\n<p>Fisika SMA/MA XI 72&nbsp;</p>\n\n<p>= 0,9 detik maka selama 3 detik massa&nbsp;</p>\n\n<p>melakukan osilasi sebanyak 3/0,9=3,3 osilasi.&nbsp;</p>\n\n<p>maka persamaan (17) memiliki penyelesaian seperti persamaan (12) yaitu persamaan (13).&nbsp;</p>\n\n<p>Persamaan (17) memiliki penyelesaian Persamaan (13) dengan:&nbsp;</p>\n\n<p>Contoh Soal 8&nbsp;</p>\n\n<p>=&nbsp;</p>\n\n<p>&nbsp;</p>\n', 1, 0, 'https://www.youtube.com/embed/KuhK7WxX9zA', 'https://www.youtube.com/watch?v=KuhK7WxX9zA', 0, '10-07-2020-1594347492-buku_guru_fisika_Kelas_XI_pdf.pdf', NULL, 0, 1, 0);
