INSERT INTO `m_materi` VALUES (52, 121, 127, 3, 'sajak', '<p>A. MATERI BASA SUNDA SAJAK</p>\n\n<p>1. WANGENAN SAJAK</p>\n\n<p>Hidep kungsi nempo penyair anu ngagalantangkeun sajak? Hidep kungsi ngilu pasanggiri ngagalantangkeun sajak? Lamun enggeus, tangtu hidep boga pangalaman anu mandiri. Lamun acan, tangtu hidep bisa diajar. Memeh prung ngagalantangkeun sajak, ayeuna urang guar heula perkara sajak.</p>\n\n<p>&nbsp;</p>\n\n<p>Naon ari puisi? Dina sastra Indonesia, nu disebut puisi teh sarua hartina jeung sajak dina sastra Sunda. Ari dina sastra Sunda, puisi teh hartina lega pisan, ngawengku sababaraha jenis karya sastra, kaasup sajak, mangrupa bagian tina puisi.</p>\n\n<p>&nbsp;</p>\n\n<p>Leuwih jelasna, nu dimaksud dina puisi dina sastra Sunda nyaeta wanda basa karangan anu rakitanana biasana mah pinuh ku wirahma, kauger ku wangunana jeung ku diksina: lain dina ungkara kalimah cara dina basa sapopoe atawa cara mangun prosa. Puisi Sunda teh rea rupana, aya nu kagolong puisi heubeul (buhun, tradisional) jeung aya nu kagolong kana puisi anyar. Puisi heubeul aya nu ngawujud carita, naratif (carita pantun, wawacan). Aya anu henteu ngawujud carita; rupa-rupa puisi mantra (jangjawokan, singlar, jampe, asihan), sisindiran (rarakitan, paparikan, wawangsalan) , kakawihan (barudak), sa&rsquo;ir (pupujian, sawer, jst), pupuh (dangding, guguritan). Ari anu kaasup puisi anyar nyaeta sajak.</p>\n\n<p>&nbsp;</p>\n\n<p>Cindekna, sajak nyaeta salah sahiji sastra Sunda anu direka dina wangun basa ugeran (puisi). sanajan ditulis dina wangun ugeran, tetela sajak mah teu pati kauger ku patokan-patokan jumlah engang saban padalisan jeung jumlah padalisan dina saban pada saperti dina pupuh atawa sisindiran.</p>\n\n<p>&nbsp;</p>\n\n<p>2. KAMEKARAN SAJAK SUNDA</p>\n\n<p>Dumasar kana asal-usulna, sajak teh mangrupa karya sampeuran anu jplna tina sastra deungeun, nyaeta pangaruh tina sastra Eropa. Eta karya teh asup tur jadi banda sastra Sunda di mimiti kira-kira taun 1946, nalika para pangarang Sunda, hususna pangarang ngora, mimiti kasengsrem tur mikaresep ngareka basa dina wangun sajak. Pangarang Sunda anu naratas gelarna sajak nyaeta Kis WA.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>Sabada ditaratas ku Kis WS, sajak Sunda terus mekar nepika kiwari. Lian tina rea sajak anu dimuat dina majalah jeung koran basa Sunda, saperti Mangle, Cupumanik, Galura, jeung Koran Sunda, oge rea karya anu geus dibukukeun mangrupa antologi. Sababaraha judul buku kumpulan sajak Sunda jeung pangarangna, diantarana : Lalaki di Tegal Pati karya sayudi (1963), Jante Arkidam karya Ajip Rosidi (1967), Tepung di Bandung karya Rahmat M.Sas. Karana, Wasiat konglomerat karya Taufik Faturohman, Lalaki Langit karya Juniarso Ridwan, Jagat Langit karya Godi Suwarna, Maung Bayangan karya Etti R.S, Jamparing Hariring karya Dedy Windyagiri, Aya Naon di Cinaon karya Wahyu Wibisana, Kidang Kawisaya karya Retty Isnendes, Katiga karangan Yayat Hendayana (1957), Gondewa karangan Etty RS (1987), Jiwalupat karangan Godi Suwarna (2007), jeung rea deui.</p>\n\n<p>&nbsp;</p>\n\n<p>3. ADEGAN (STRUKTUR; UNSUR) SAJAK</p>\n\n<p>Sajak teh mangrupa ungkara pikiran, rasa jeung gagasan pangarang, nu ditepikeun pikeun ngagambarkeun hiji pasualan. Eta pasualan teh asalna bisa dina kanyataan kahirupan sapopoe, bisa oge ukur reka cipta pengarang sabada ngaliwatan proses imajinasi jeung kontemplasi, anu satuluyna dijanggelekkeun dina wangun rakitan basa anu endah.</p>\n\n<p>&nbsp;</p>\n\n<p>Biasana sajak mah ditulis dina wangun ungkara konotatif (kiasan). Ku kituna sajak mah aya kalana hese dipikahartina, lantara ari ungkara konotatif mah loba salib jeung siloka. Beda jeung harti denotatif anu ngungkabkeun harti sajalantrahna. Tapi najan kitu, tetep we unggal sajak mibanda ma&rsquo;na jeung amanat keur nu macana. Ku kituna, tangtu bae sajak teh mibanda unsur-unsur pangwangun anu ngadeudeul kana jenglengan rumpakana eta. Eta unsur-unsur teh diantarana:</p>\n\n<p>&nbsp;</p>\n\n<p>a. Jejer (Tema)</p>\n\n<p>&nbsp;</p>\n\n<p>Tema teh gagasan poko anu rek ditepikeun ku pangayak ka nu maca. Tema dina sajak rupa-rupa, aya tema kaagamaan, kamanusiaan, cinta ka lemah cai, jste. Upamana wae sajak &ldquo;Tanah Sunda&rdquo; di luhur teh nyaritakeun kaayaan tanah Sunda anu keur harengheng. Jadi bisa dicindekkeun temana teh ngeunaan cinta ka lemah cai (sarakan).</p>\n\n<p>&nbsp;</p>\n\n<p>b. Nada jeung Suasana</p>\n\n<p>&nbsp;</p>\n\n<p>Nada teh sikep pangayak ka n maca. Tina sikep pangayak ngabalukarkeun ayana suasana nu karasa ku nu macca. Geura titenan pada sempalan sajak &ldquo;Tanah Sunda&rdquo; ieu di handap.</p>\n\n<p>&nbsp;</p>\n\n<p>Hejo pagunungan paul lautan</p>\n\n<p>&nbsp;</p>\n\n<p>Taya kamarasan ngan katugenahan</p>\n\n<p>&nbsp;</p>\n\n<p>Hejo pagunungan paul lautan</p>\n\n<p>&nbsp;</p>\n\n<p>Taya katengtreman ngan ancaman</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>Dumasar pada sajak di luhur, katangen sikep pangajak teh hayang ngabejaan ka nu maca yen najan tanah Sunda teh endah, tapi tetep hendteu tengtrem tur loba ancaman. Tina sikep eta urang salaku nu maca bisa ngarasa keueung jeung ngahanjakalkeun ku kaayaan kitu.</p>\n\n<p>&nbsp;</p>\n\n<p>c. Rasa</p>\n\n<p>&nbsp;</p>\n\n<p>Rasa teh ngajiwaan eusi sajak. Rasa dina sajak bisa kapanggih sabada dibaca. Naha dibacana teh digorowokeun, digalantangkeun, dihariringkeun atawa dilenyepan dina jero hate. Sajak &ldquo;Tanah Sunda&rdquo; upamana, moal kapanggih rasa eusina mun dibacana ukur dina jero hate. Sabalikna baris kapanggih tur karasa kumaha keueungna, mun macana digorowokeun atawa digalantangkeun.</p>\n\n<p>&nbsp;</p>\n\n<p>B. NGAGALANTAKEUN SAJAK</p>\n\n<p>Ieu dihandap aya teks sajak. Pek ku hidep ngagalantakeun di hareupeun babaturan sakelas. Bagilir wae saurang-saurang, anu sejenna ngaregepkeun sing daria.</p>\n\n<p>&nbsp;</p>\n\n<p>TANAH SUNDA</p>\n\n<p>Karya : Ajip Rosidi</p>\n\n<p>&nbsp;</p>\n\n<p>H&eacute;jo pagunungan</p>\n\n<p>Paul lautan</p>\n\n<p>H&eacute;jo</p>\n\n<p>Paul</p>\n\n<p>Langit na hat&eacute; kuring</p>\n\n<p>&nbsp;</p>\n\n<p>Masing dimana kuring nangtung</p>\n\n<p>Masing kamana kuring leumpang</p>\n\n<p>Tanah l&eacute;mbok tempak bumetah</p>\n\n<p>Angin nyeot nyiuman tarang</p>\n\n<p>&nbsp;</p>\n\n<p>Masing dimana anjeun nunjuk</p>\n\n<p>Masing iraha anjeun cumeluk</p>\n\n<p>Kuring mo mumpang , kuring r&eacute;k datang</p>\n\n<p>Neueulkeun tarang , neueulkeun jantung</p>\n\n<p>&nbsp;</p>\n\n<p>Kuring tungtung teteupan</p>\n\n<p>Kuring tungtung</p>\n\n<p>Teteupan</p>\n\n<p>Tuntung bedil</p>\n\n<p>Ngincer dada</p>\n\n<p>&nbsp;</p>\n\n<p>Kuring geus nyaksian getih ngabayah</p>\n\n<p>Getih maranehna nu mikacinta anjeun</p>\n\n<p>Kuring geus nyaksian panon carelong tanggah</p>\n\n<p>Jasadnu ruksak ngalungsar na dada anjeun</p>\n\n<p>&nbsp;</p>\n\n<p>H&eacute;jo pagunungan , paul lautan</p>\n\n<p>Taya kamarasan ngan katugenahan</p>\n\n<p>H&eacute;jo pagunungan , paul lautan</p>\n\n<p>Taya katengtreman , ngan ancaman !</p>\n', 1, 0, 'https://www.youtube.com/embed/xXZXT99WD_E', 'https://www.youtube.com/watch?v=xXZXT99WD_E', 0, '10-07-2020-1594347443-sajak.pdf', NULL, 0, 1, 0);
