INSERT INTO `m_materi` VALUES (62, 149, 141, 3, 'Kelompok Sosial', '<p>Materi pertama sosiologi di kelas XI semester 1 adalah tentang kelompok sosial. Sebelum membasnya lebih jauh, kita harus mengetahui terlebih dahulu hakikat mengapa manusia hidup berkelompok.</p>\n\n<p><strong>Kelompok sosial</strong>&nbsp;merupakan sekumpulan individu dengan karakteristik tertentu dan kesamaan identitas yang saling berinteraksi bersama serta memiliki kesadaran kolektif sebagai satu kesatuan.</p>\n\n<p>Selengkapnya, silakan lihat file PDF UKBM.</p>\n', 1, 0, 'https://www.youtube.com/embed/D-LRVzS-YPA', 'https://www.youtube.com/watch?v=D-LRVzS-YPA', 0, NULL, NULL, 1, 0, 0);
