INSERT INTO `m_materi` VALUES (75, 155, 138, 3, '3.1 POSISI STRATEGIS INDONESIA SEBAGAI POROS DUNIA', '<table cellspacing=\"0\" style=\"width:100.0%\">\n	<tbody>\n		<tr>\n			<td rowspan=\"3\" style=\"background-color:#a6a6a6; width:76.3pt\">\n			<p><strong>UKBM</strong></p>\n\n			<p>1</p>\n			</td>\n			<td style=\"background-color:#a6a6a6; width:375.65pt\">\n			<p>&nbsp;</p>\n\n			<p><strong>GEO/3.1/4.1/3/1-1</strong></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:#a6a6a6; width:375.65pt\">\n			<p><strong>MAGMA 1</strong><strong> : &ldquo;</strong><strong>BEAUTIFUL INDONESIA</strong><strong>&rdquo;</strong></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:#a6a6a6; width:375.65pt\">\n			<p>&nbsp;</p>\n\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<table cellspacing=\"0\" style=\"width:100.0%\">\n	<tbody>\n		<tr>\n			<td style=\"background-color:#a6a6a6; width:449.05pt\">\n			<p>&nbsp;</p>\n\n			<p><strong>IDENTITAS UKBM</strong></p>\n\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<table cellspacing=\"0\" style=\"width:98.9%\">\n	<tbody>\n		<tr>\n			<td style=\"width:140.25pt\">\n			<p>Mata Pelajaran</p>\n			</td>\n			<td style=\"width:13.9pt\">\n			<p>:</p>\n			</td>\n			<td style=\"width:289.95pt\">\n			<p>Geografi</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:140.25pt\">\n			<p>Semester</p>\n			</td>\n			<td style=\"width:13.9pt\">\n			<p>:</p>\n			</td>\n			<td style=\"width:289.95pt\">\n			<p>3</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:140.25pt\">\n			<p>&nbsp;</p>\n\n			<table border=\"1\">\n				<tbody>\n					<tr>\n						<td style=\"background-color:white\">\n						<table style=\"width:100%\">\n							<tbody>\n								<tr>\n									<td>\n									<p>3.1 Memahami kondisi wilayah dan posisi strategis Indonesia sebagai poros maritim dunia</p>\n\n									<p>4.1 Menyajikan contoh hasil penalaran tentang posisi strategis wilayah Indonesia sebagai poros maritim dunia dalam bentuk peta, tabel, dan/atau grafik.</p>\n\n									<p>&nbsp;</p>\n									</td>\n								</tr>\n							</tbody>\n						</table>\n						</td>\n					</tr>\n				</tbody>\n			</table>\n			Kompetensi Dasar</td>\n			<td style=\"width:13.9pt\">\n			<p>:</p>\n			</td>\n			<td style=\"width:289.95pt\">\n			<p>&nbsp;</p>\n\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Indikator Pencapaian Kompetensi:</strong></p>\n\n<table cellspacing=\"0\" style=\"width:100.0%\">\n	<tbody>\n		<tr>\n			<td style=\"width:217.35pt\">\n			<p><strong>Kompetensi Dasar</strong></p>\n			</td>\n			<td style=\"width:231.7pt\">\n			<p><strong>Indikator Pencapaian Kompetensi</strong></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:#cccccc; width:217.35pt\">\n			<p><strong>3.1 </strong><strong>Memahami kondisi wilayah dan posisi strategis Indonesia sebagai poros maritim dunia</strong></p>\n\n			<p>&nbsp;</p>\n			</td>\n			<td style=\"background-color:#cccccc; width:231.7pt\">\n			<p>3.1.1 Memahami luas dan batas posisi negara Indonesia</p>\n\n			<p>3.1.2 Memahami karakterisistik wilayah daratan dan lautan Republik Indonesia dari barat hingga ke timur</p>\n\n			<p>3.1.3 mennganalisis jalur perdagangan internasional</p>\n\n			<p>3.14 Menganalisis potensi sumber daya kelautan Indonesia</p>\n\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:217.35pt\">\n			<p><strong>4</strong><strong>.</strong><strong>1 </strong><strong>Menyajikan contoh hasil penalaran tentang posisi strategis wilayah Indonesia sebagai poros maritim dunia dalam bentuk peta, tabel, dan/atau grafik.</strong></p>\n\n			<p>&nbsp;</p>\n			</td>\n			<td style=\"width:231.7pt\">\n			<p>4.1.1 Menyajikan data atau tabel terkait kekuatan Indonesia sebagai poros maritim dunia</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<table cellspacing=\"0\" style=\"width:100.0%\">\n	<tbody>\n		<tr>\n			<td style=\"width:140.1pt\">\n			<p>Materi Pokok</p>\n			</td>\n			<td style=\"width:20.15pt\">\n			<p>:</p>\n			</td>\n			<td style=\"width:338.85pt\">\n			<p>Posisi Strategis Indonesia Sebagai Poros Maritim Dunia</p>\n\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:140.1pt\">\n			<p>Alokasi Waktu</p>\n			</td>\n			<td style=\"width:20.15pt\">\n			<p>:</p>\n			</td>\n			<td style=\"width:338.85pt\">\n			<p>10 x 45&rsquo;</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<table cellspacing=\"0\" style=\"width:100.0%\">\n	<tbody>\n		<tr>\n			<td style=\"width:917.0pt\">\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:silver; width:917.0pt\">\n			<p><strong>Tujuan Pembelajaran&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :</strong></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:917.0pt\">\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:silver; width:917.0pt\">\n			<p>&nbsp;</p>\n\n			<p><strong>Melalui metode saintifik,</strong><strong> inkuiri, discovery,</strong><strong> diskusi, tanya jawab, penugasan dan presentasi, kalian dapat memahami Letak, luas, dan Batas Wilayah Indonesia, Karakteristik Wilayah Daratan dan Perairan Indonesia, perkembangan jalur transportasi dan perdagangan internasional di indonesia, potensi dan pengelolaan sumber daya kelautan indonesia, posisi strategis indonesia sebagai poros maritim dunia serta </strong><strong>menyajikan contoh hasil penalaran tentang posisi strategis wilayah indonesia sebagai poros maritim dunia dalam bentuk peta, tabel, dan / atau grafik</strong><strong>. sehingga peserta didik dapat menghayati dan mengamalkan ajaran mengembangkan sikap jujur, disiplin, dan bertanggungjawab, serta dapat mengembangkan kemampuan berpikir kritis, komunikasi, kolaborasi, kreativitas (4C).</strong></p>\n\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<table cellspacing=\"0\" style=\"width:100.0%\">\n	<tbody>\n		<tr>\n			<td colspan=\"3\" style=\"background-color:#a5a5a5; width:100.0%\">\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td colspan=\"3\" style=\"background-color:#a5a5a5; width:100.0%\">\n			<p><strong>Materi Pembelajaran&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :</strong></p>\n			</td>\n		</tr>\n		<tr>\n			<td colspan=\"3\" style=\"background-color:#a5a5a5; width:100.0%\">\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:#a5a5a5; width:15.26%\">\n			<p><strong>Faktual</strong></p>\n			</td>\n			<td style=\"background-color:#d8d8d8; width:3.06%\">\n			<p>:</p>\n			</td>\n			<td style=\"background-color:#d8d8d8; width:81.68%\">\n			<p>Sabang dan Merauke, Laut Natuna, Ibukota, Jakarta, 183 Gunung Api Aktif, Malaysia dan Singapura</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:#a5a5a5; width:15.26%\">\n			<p><strong>Konseptual</strong></p>\n			</td>\n			<td style=\"width:3.06%\">\n			<p>:</p>\n			</td>\n			<td style=\"width:81.68%\">\n			<p>Letak, luas, dan batas wilayah Indonesia</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:#a5a5a5; width:15.26%\">\n			<p><strong>Metakognitif</strong></p>\n			</td>\n			<td style=\"background-color:#d8d8d8; width:3.06%\">\n			<p>:</p>\n			</td>\n			<td style=\"background-color:#d8d8d8; width:81.68%\">\n			<p>Karakteristik wilayah daratan dan perairan Indonesia atau Perkembangan jalur transportasi dan perdagangan internasional di Indonesia dan Potensi dan pengelolaan sumber daya kelautan Indonesia.</p>\n\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p><img src=\"file:///C:/Users/MYCOM/AppData/Local/Temp/msohtmlclip1/01/clip_image001.png\" style=\"height:163px; width:639px\" /></p>\n\n<table cellspacing=\"0\" style=\"width:100.0%\">\n	<tbody>\n		<tr>\n			<td style=\"background-color:#0070c0; width:100.0%\">\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td style