p>\n			</td>\n			<td colspan=\"2\" style=\"background-color:#cccccc; width:943.55pt\">\n			<p>Baca dan pahami BTP (Buku Teks Pembelajaran) . Yasinto Sindhu. 2016. Geografi XI Peminatan Ilmu-ilmu Sosial untuk SMA dan MA. Jakarta: Erlangga.</p>\n\n			<ol>\n				<li>Bambang Nianto Mulyo, Purwadi Suhandini. 2013. Geografi Kelompok Peminatan Ilmu Pengetahuan Sosial untuk SMA/MA Kelas X. Solo: PT Wangsa Jatra Lestari.</li>\n				<li>Yumaldia Yulir.2016.</li>\n				<li>Geografi 1. Yudhistira</li>\n			</ol>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:white; width:1.0cm\">\n			<p><em>2.</em></p>\n			</td>\n			<td colspan=\"2\" style=\"width:943.55pt\">\n			<p>Setelah memahami isi materi, berlatihlah memperluas pengalaman belajar melalui tugas-tugas atau kegiatan-kegiatan belajar 1 dan 2 baik yang harus kalian kerjakan sendiri maupun bersama teman sebangku atau teman lainnya sesuai instruksi guru.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:white; width:1.0cm\">\n			<p><em>3.</em></p>\n			</td>\n			<td colspan=\"2\" style=\"background-color:#cccccc; width:943.55pt\">\n			<p>Kerjakan tugas-tugas di buku kerja yang sudah kalian siapkan sebelumnya.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:white; width:1.0cm\">\n			<p><em>4.</em></p>\n			</td>\n			<td colspan=\"2\" style=\"width:943.55pt\">\n			<p>Apabila kalian yakin sudah paham dan mampu menyelesaikan permasalahan-permasalahan dalam kegiatan belajar 1 dan 2, kalian boleh sendiri atau mengajak teman lain yang sudah siap untuk mengikuti tes formatif agar kalian dapat belajar ke UKBM berikutnya (jika belum memenuhi KKM kalian harus mempelajari ulang materi ini kemudian minta tes lagi sampai memenuhi KKM).</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:white; width:1.0cm\">\n			<p><em>5.</em></p>\n			</td>\n			<td colspan=\"2\" style=\"background-color:#cccccc; width:943.55pt\">\n			<p>Jangan lupa melalui pembelajaran ini kalian dapat mengembangkan sikap jujur, peduli, dan bertanggungjawab, serta dapat mengembangkan kemampuan <strong>berpikir kritis, komunikasi, kolaborasi, kreativitas.</strong></p>\n\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<table cellspacing=\"0\" style=\"width:100.0%\">\n	<tbody>\n		<tr>\n			<td style=\"background-color:#bfbfbf; width:449.05pt\">\n			<p>&nbsp;</p>\n\n			<p><strong>PROSES BELAJAR</strong></p>\n\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<table cellspacing=\"0\" style=\"width:99.82%\">\n	<tbody>\n		<tr>\n			<td style=\"background-color:#0070c0; width:100.0%\">\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:100.0%\">\n			<p><strong>Pendahuluan</strong></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:#0070c0; width:100.0%\">\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:#bfbfbf; width:100.0%\">\n			<p>&nbsp;</p>\n\n			<p>Sebelum masuk ke materi,</p>\n\n			<p><img src=\"file:///C:/Users/MYCOM/AppData/Local/Temp/msohtmlclip1/01/clip_image004.png\" style=\"height:72px; width:89px\" /><img alt=\"Hasil gambar untuk INDONESIA\" src=\"file:///C:/Users/MYCOM/AppData/Local/Temp/msohtmlclip1/01/clip_image006.jpg\" style=\"height:186px; width:382px\" /></p>\n\n			<p>APA YANG ADA DI BENAK KALIAN JIKA MELIHAT GAMBAR TERSEBUT&hellip;..</p>\n\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<table cellspacing=\"0\" style=\"width:100.0%\">\n	<tbody>\n		<tr>\n			<td colspan=\"2\" style=\"width:58.68%\">\n			<p>&nbsp;</p>\n			</td>\n			<td style=\"width:41.28%\">\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td colspan=\"2\" style=\"background-color:#cccccc; width:58.68%\">\n			<p><strong>Kegiatan Inti</strong></p>\n			</td>\n			<td style=\"background-color:#cccccc; width:41.28%\">\n			<p><strong>Kegiatan Belajar 1</strong></p>\n			</td>\n		</tr>\n		<tr>\n			<td colspan=\"2\" style=\"width:58.68%\">\n			<p>&nbsp;</p>\n			</td>\n			<td style=\"width:41.28%\">\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:#cccccc; width:3.4%\">\n			<p><strong><img alt=\"Open Book\" src=\"file:///C:/Users/MYCOM/AppData/Local/Temp/msohtmlclip1/01/clip_image008.png\" style=\"height:57px; width:57px\" /></strong></p>\n			</td>\n			<td colspan=\"2\" style=\"background-color:#cccccc; width:96.6%\">\n			<p>&nbsp;</p>\n\n			<p><strong>Identifikasi dan </strong><strong>pahami isi wacana tentang Lokasi dan profil tentang negara Indonesia</strong><strong> yang seharusnya berkembang menjadi negara maju</strong></p>\n			</td>\n		</tr>\n		<tr>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<table cellspacing=\"0\" style=\"width:100.0%\">\n	<tbody>\n		<tr>\n			<td style=\"width:449.05pt\">\n			<p>&nbsp;</p>\n\n			<p><strong>Posisi Indonesia Sebagai Poros Maritim Dunia</strong></p>\n\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:#cccccc; width:449.05pt\">\n			<p>&nbsp;</p>\n\n			<p><strong>Batas wilayah laut Indonesia adalah Timur Indonesia berbatasan dengan Papua Nugini; Barat Indonesia berbatasan dengan Samudera Hindia dan Laut Andaman; Utara Indonesia berbatasan dengan Selat Malaka, Malaysia, Singapura, Thailand, Vietnam, Republik Palau, dan Filipina; Selatan Indonesia berbatasan dengan Australia dan Samudera Hindia.</strong><br />\n			&nbsp;</p>\n\n			<table>\n				<tbody>\n					<tr>\n						<td style=\"background-color:white\">\n						<p><a href=\"https://2.bp.blogspot.com/-g2x9Vw8jY_A/W3ZBeBwvfMI/AAAAAAAAAE0/tsbC9NKQZHckmZuxK3BG_RmkW23AXF4RQCEwYBhgL/s1600/geo2.jpg\"><img alt=\"https://2.bp.blogspot.com/-g2x9Vw8jY_A/W3ZBeBwvfMI/AAAAAAAAAE0/tsbC9NKQZHckmZuxK3BG_RmkW23AXF4RQCEwYBhgL/s400/geo2.jpg\" src=\"https://2.bp.blogspot.com/-g2x9Vw8jY_A/W3ZBeBwvfMI/AAAAAAAAAE0/tsbC9NKQZHckmZuxK3BG_RmkW23AXF4RQCEwYBhgL/s400/geo2.jpg\" style=\"height:107.25pt; width:300pt\" /> <img alt=\"https://2.bp.blogspot.com/-g2x9Vw8jY_A/W3ZBeBwvfMI/AAAAAAAAAE0/tsbC9NKQZHckmZuxK3BG_RmkW23AXF4RQCEwYBhgL/s400/geo2.jpg\" src=\"https://2.bp.blogspot.com/-g2x9Vw8jY_A/W3ZBeBwvfMI/AAAAAAAAAE0/tsbC9NKQZHckmZuxK3BG_RmkW23AXF4RQCEwYBhgL/s400/geo2.jpg\" style=\"height:143px; width:400px\" /></a></p>\n						</td>\n					</tr>\n					<tr>\n						<td style=\"background-color:white\">\n						<p>Perbatasan Indonesia</p>\n						</td>\n					</tr>\n				</tbody>\n			</table>\n\n			<p><strong>Secara geografis, Indonesia terletak diantara Benua Asia dan Benua Australia, Samudera Hindia dan Samudera Pasifik. Dari letak ini, Indonesia yang terletak di antara dua samudera besar mempunyai dampak mendapat angin laut yang membawa banyak hujan. Hal ini pula yang menyebabkan Indonesia memiliki iklim tropis. Selain itu, letak geografis Indonesia juga menyebabkan Indonesia memiliki dua musim. Hal ini dipengaruhi oleh angin musim yang berhembus tiap enam bulan sekali.</strong><br />\n			<strong>Jika dilihat dari pososi Astronomis, Indonesia terletak di 6o LU (Lintang Utara) - 11o LS (Lintang Selatan) dan 95o BT (Bujur Timur) - 141o BT (Bujur Timur). Dampak yang disebabkan dari kedua garis ini (garis lintang dan garis bujur) tentunya berbeda. Dampak dari garis Bujur Indonesia adalah Indonesia memiliki tiga daerah waktu yang berbeda (WIB, WIT, WITA). Dampak dari garis Lintang Indonesia adalah:<br />\n			Curah hujan tinggi</strong></p>\n\n			<ul>\n				<li><strong>Terdapat hutan hujan tropis yang luas</strong></li>\n				<li><strong>Sinar matahari sepanjang tahun</strong></li>\n				<li><strong>Kelembaban udara yang tinggi</strong></li>\n			</ul>\n\n			<p><strong>Jika dilihat dari segi geologis, Indonesia terletak pada daerah dangkalan Sunda, daerah dangkalan Sahul, dan daerah dangkalan Sunda- Sahul. Dampak dari letak geologis ini adalah:</strong><br />\n			<strong>Banyak Gunung Aktif</strong></p>\n\n			<ul>\n				<li><strong>Pembagian Laut</strong></li>\n				<li><strong>Memiliki Tambang Mineral</strong></li>\n				<li><strong>Sering Terjadi Gempa</strong></li>\n				<li><strong>Tanah yang Subur</strong></li>\n			</ul>\n\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:449.05pt\">\n			<p>&nbsp;</p>\n\n			<p><strong>GEOTEST !</strong></p>\n\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<ol>\n	<li>Pernyataan:</li>\n</ol>\n\n<p>1) Memiliki iklim tropis,&nbsp;</p>\n\n<p>2) Memiliki 3 xona waktu,</p>\n\n<p>3) Memiliki curah hujan tinggi,</p>\n\n<p>4) Memiliki lebih 17.000 pulau,</p>\n\n<p>5) Memiliki bioma hutan hujan tropis.</p>\n\n<p>Pernyataan yang menunjukkan dampak yang dipengaruhi letak garis lintang Indonesia adalah ....</p>\n\n<p>A. 1), 2), 3)</p>\n\n<p>B. 1), 3), 5)</p>\n\n<p>C. 2), 3), 4)</p>\n\n<p>D. 2), 3), 5)</p>\n\n<p>E. 3), 4), 5)</p>\n\n<ol>\n	<li>Seorang pilot yang akan menerbangkan pesawat terbang komersil tujuan Denpasar, Bali, melakukan lepas landas pesawat pada pukul 07.00 WIB dari kota Bandung. Waktu tempuh perjalanan Bandung &ndash; Denpasar adalah 60 menit. Maka pesawat tersebut akan tiba di Denpasar pada pukul ....</li>\n</ol>\n\n<p>A. 08.00 WIB</p>\n\n<p>B. 08.00 WITA</p>\n\n<p>C. 09.00 WIT</p>\n\n<p>D. 09.00 WITA</p>\n\n<p>E. 10.00 WITA</p>\n\n<ol>\n	<li>Negara yang berbatasan wilayah dengan Indonesia:</li>\n</ol>\n\n<p>1) Malaysia 2) Singapura</p>\n\n<p>3) Thailand 4) Papua Nugini</p>\n\n<p>5) Timor Leste</p>\n\n<p>Negara yang batas wilayahnya ditandai dengan adanya patok dan demarkasi ditunjukkan oleh nomor ....</p>\n\n<p>&nbsp;A. 1), 2), 3)</p>\n\n<p>B. 1), 4), 5)</p>\n\n<p>C. 2), 3), 4)</p>\n\n<p>D. 2), 3), 5)</p>\n\n<p>E. 3), 4), 5)</p>\n\n<ol>\n	<li>Negara yang berbatasan langsung sebelah timur laut Indonesia adalah ....</li>\n</ol>\n\n<p>A. Palau</p>\n\n<p>B. India</p>\n\n<p>C. Singapura</p>\n\n<p>D. Australia</p>\n\n<p>E. Papua Nugini</p>\n\n<ol>\n	<li>Zona perairan yang terletak di atas paparan benua disebut ....</li>\n</ol>\n\n<p>A. Zona Fotik</p>\n\n<p>B. Zona Afotik</p>\n\n<p>C. Zona Neartik</p>\n\n<p>D. Zona Bathyal E. Zona Litoral</p>\n\n<ol>\n	<li>Teripang yang didapat dari laut merupakan sumber daya bahari yang dapat dimanfaatkan sebagai ....</li>\n</ol>\n\n<p>A. Sumber pangan</p>\n\n<p>B. Sumber mineral</p>\n\n<p>C. Sumber ekonomi</p>\n\n<p>D. Sumber obat-obatan</p>\n\n<p>E. Sumber lapangan kerja&nbsp;</p>\n\n<ol>\n	<li>Selat Malaka merupakan jalur perdagangan internasional termasuk ke dalam alur lintas kepulaian Indonesia khususnya jalur .....</li>\n</ol>\n\n<p>A. ALKI I</p>\n\n<p>B. ALKI II</p>\n\n<p>C. ALKI IIIa</p>\n\n<p>D. ALKI IIIb</p>\n\n<p>E. ALKI IIIc</p>\n\n<ol>\n	<li>Jenis sumder daya bahari Indonesia:</li>\n</ol>\n\n<p>1) Ikan Cakalang&nbsp; 2) Ikan Duyung 3) Ikan Tuna 4) Sotong 5) Penyu</p>\n\n<p>Sumber daya bahari yang dapat dijadikan komoditas ekspor ditunjukkan oleh nomor ....</p>\n\n<p>A. 1), 2), 3)</p>\n\n<p>B. 1), 2), 5)</p>\n\n<p>C. 1), 3), 4)</p>\n\n<p>D. 2), 3), 5)</p>\n\n<p>E. 3), 4), 5)</p>\n\n<ol>\n	<li>Daerah tujuan pariwisata bahari Indonesia yang berlokasi di utara pulau Jawa adalah ....</li>\n</ol>\n\n<p>A. Wakatobi</p>\n\n<p>B. Raja Ampat</p>\n\n<p>C. Pantai Kuta</p>\n\n<p>D. Teluk Tomini</p>\n\n<p>E. Kepulauan Seribu</p>\n\n<ol>\n	<li>Salah satu upaya langsung yang dapat dilakukan pemerintah Indonesia dalam peningkatan optimalisasi kunjungan wisatawan mancanegara adalah ....</li>\n</ol>\n\n<p>A. Mendatangkan investor asing</p>\n\n<p>B. Mengedukasi masyarakat lokal</p>\n\n<p>C. Menjaga stabilitas ekonomi negara</p>\n\n<p>D. Mempermudahkan perizinan wisman</p>\n\n<p>E. Promosi wisata lewat berbagai media</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Ke</strong></p>\n\n<p>&nbsp;</p>\n\n<p><img src=\"file:///C:/Users/MYCOM/AppData/Local/Temp/msohtmlclip1/01/clip_image010.png\" style=\"height:40px; width:165px\" /><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kegiatan Belajar 2</strong></p>\n\n<p>&nbsp;</p>\n\n<p>KARAKTERISTIK WILAYAH DARATAN DAN PERAIRAN INDONESIA</p>\n\n<p>Setiap provinsi di Indonesia memiliki ciri-ciri kenampakan alam yang berbeda-beda. Kenampakan alam di Indonesia yang dapat dilihat pada peta adalah kenampakan alam daratan dan perairan.&nbsp;&nbsp; Kenampakan alam daratan berupa pegunungan, gunung, dataran rendah, dan tanjung. Sedangkan kenampakan alam perairan berupa sungai, danau, laut, dan selat. Berikut ini akan dijelaskan kenampakan alam wilayah Indonesia seperti pegunungan, gunung, sungai, danau, laut, dan selat.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>GEOTEST !</strong></p>\n\n<p>&nbsp;</p>\n\n<table border=\"1\">\n	<tbody>\n		<tr>\n			<td style=\"background-color:white\">\n			<table style=\"width:100%\">\n				<tbody>\n					<tr>\n						<td>\n						<p><img src=\"file:///C:/Users/MYCOM/AppData/Local/Temp/msohtmlclip1/01/clip_image012.jpg\" style=\"height:236px; width:414px\" /></p>\n						</td>\n					</tr>\n				</tbody>\n			</table>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>Dari gambar diatas sebutkan letak astronomis dan geografis indonesia</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<table border=\"1\" cellspacing=\"0\" style=\"width:354.9pt\">\n	<tbody>\n		<tr>\n			<td style=\"width:99.25pt\">\n			<p>Letak astronomis</p>\n			</td>\n			<td style=\"width:255.65pt\">\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:99.25pt\">\n			<p>Wilayah zona astronomis</p>\n			</td>\n			<td style=\"width:255.65pt\">\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:99.25pt\">\n			<p>Letak geografis</p>\n			</td>\n			<td style=\"width:255.65pt\">\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:99.25pt\">\n			<p>Luas ZEE</p>\n			</td>\n			<td style=\"width:255.65pt\">\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:99.25pt\">\n			<p>Luas batas teritorial</p>\n			</td>\n			<td style=\"width:255.65pt\">\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:99.25pt\">\n			<p>Luas Landas Kontinen</p>\n			</td>\n			<td style=\"width:255.65pt\">\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>Negara mana saja yang berbatasan dengan wilayah negara Indonesia secara langsung</p>\n\n<table border=\"1\" cellspacing=\"0\" style=\"width:356.95pt\">\n	<tbody>\n		<tr>\n			<td style=\"width:27.35pt\">\n			<p>1</p>\n			</td>\n			<td style=\"width:53.1pt\">\n			<p>Utara</p>\n			</td>\n			<td style=\"width:276.5pt\">\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:27.35pt\">\n			<p>2</p>\n			</td>\n			<td style=\"width:53.1pt\">\n			<p>Timur</p>\n			</td>\n			<td style=\"width:276.5pt\">\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:27.35pt\">\n			<p>3</p>\n			</td>\n			<td style=\"width:53.1pt\">\n			<p>Selatan</p>\n			</td>\n			<td style=\"width:276.5pt\">\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:27.35pt\">\n			<p>4</p>\n			</td>\n			<td style=\"width:53.1pt\">\n			<p>Barat</p>\n			</td>\n			<td style=\"width:276.5pt\">\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>Apabila kalian telah mampu menyelesaikan persoalan di atas, maka kalian bisa melanjutkan pada kegiatan belajar 2 berikut.</p>\n\n<p>&nbsp;</p>\n\n<table style=\"width:100%\">\n	<tbody>\n		<tr>\n			<td>\n			<p>KEGIATAN BELAJAR 3</p>\n\n			<p>&nbsp;</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p><img alt=\"Rounded Rectangle: KEGIATAN BELAJAR 3\n\n\" src=\"file:///C:/Users/MYCOM/AppData/Local/Temp/msohtmlclip1/01/clip_image013.png\" style=\"height:44px; width:169px\" /><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>Potensi Sumberdaya Pesisir dan Laut di Indonesia&nbsp; Indonesia terkenal sebagai negara kepulauan terbesar di dunia, dengan potensi sumberdaya laut dan pesisir yang sangat menjanjikan. Wilayah pesisir dan lautan merupakan wilayah yang memiliki arti penting secara ekonomi dan politik bagi kehidupan masyarakat di Indonesia sejak dahulu. Sumberdaya di wilayah pesisir merupakan penopang hidup bagi masyarakat yang hidup di pesisir untuk memperoleh makanan, kayu bakar, bangunan, dan fungsi lainnya.</p>\n\n<p>Berkaitan dengan jalur perdagangan dan distribusi penumpang, saat ini pemerintah hIndonesia mengeluarkan kebijakan mengenai pengembangan tol laut. Tol laut adalah kepal alut yang berlayar secara rutin dan terjadwal yang menghubungkan nwilayah Indonesia dari barat samapai ke timur dan dari utara sampai ke selatan.<br />\n&nbsp;</p>\n\n<table>\n	<tbody>\n		<tr>\n			<td style=\"background-color:white\">\n			<p><a href=\"https://3.bp.blogspot.com/-IRT3AYGDewM/W3ZE1tHQAmI/AAAAAAAAAFE/GfcONU5e214v0yxPAMmEGlHewATM9JOWgCLcBGAs/s1600/geo%2B4.jpg\"><img alt=\"https://3.bp.blogspot.com/-IRT3AYGDewM/W3ZE1tHQAmI/AAAAAAAAAFE/GfcONU5e214v0yxPAMmEGlHewATM9JOWgCLcBGAs/s1600/geo%2B4.jpg\" src=\"https://3.bp.blogspot.com/-IRT3AYGDewM/W3ZE1tHQAmI/AAAAAAAAAFE/GfcONU5e214v0yxPAMmEGlHewATM9JOWgCLcBGAs/s1600/geo%2B4.jpg\" style=\"height:137.25pt; width:206.25pt\" /> <img alt=\"https://3.bp.blogspot.com/-IRT3AYGDewM/W3ZE1tHQAmI/AAAAAAAAAFE/GfcONU5e214v0yxPAMmEGlHewATM9JOWgCLcBGAs/s1600/geo%2B4.jpg\" src=\"https://3.bp.blogspot.com/-IRT3AYGDewM/W3ZE1tHQAmI/AAAAAAAAAFE/GfcONU5e214v0yxPAMmEGlHewATM9JOWgCLcBGAs/s1600/geo%2B4.jpg\" style=\"height:183px; width:275px\" /></a></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:white\">\n			<p>maritimnews.com</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p><br />\nMenurut Prihartono (2015) dalam pengembangan tol laut terdapat konsep wilayah depan (foreland) dan wilayah dalam (hinterland). Konsep wilayah ini merupakan koridor ekonomi yang berbasis maritim dan sistem logistik untuk mendukung sektor perdagangan, baik dari sumber daya kelautan maupun daratan. Selain itu, koridor ekonomi tersebut akan mendorong terciptanya pusat- pusat pertumbuhan baru dan pemerataan ekonomi di seluruh wilayah Nusantara. Adapun tujuan dari program tol laut Indonesia dunia, yaitu sebagai berikut.<br />\n&nbsp;</p>\n\n<ul>\n	<li>Memanfaatkan semaksimal mungkin kekayaan sumber day akelautan dan perikanan untuk kesejahteraan masyarakat Indonesia.</li>\n	<li>Meningkatkan kesejahteraan masyarakat di wilayah pesisir dan pulau- pulau kecil yang selama ini sulit mendapatkan akses terhadap pembangunan.</li>\n	<li>Memudahkan masyarakat yang tinggal di daetah pesisir dan kepulauan untuk mengakses kota- kota besar.</li>\n	<li>Memudahkan anak- anak yang tinggal di pulau- pulau kecil dan terpencil untuk bersekolah di kota besar.</li>\n	<li>Menekan ketimpangan harga antara Pulau Jawa dan luatr Pulau Jawa. Penekanan distribusi kekayaan seumber daya alam Indonesia maupun penduduk.Tol laut akan memudahkan pergerakan penduduk semakin mudah, murah, dan cepat.</li>\n</ul>\n\n<p><strong>GEOTEST !</strong></p>\n\n<p>Perhatikan gambar dibawah ini</p>\n\n<table border=\"1\" cellspacing=\"0\">\n	<tbody>\n		<tr>\n			<td style=\"width:220.15pt\">\n			<p><img src=\"file:///C:/Users/MYCOM/AppData/Local/Temp/msohtmlclip1/01/clip_image016.jpg\" style=\"height:194px; width:297px\" /></p>\n			</td>\n			<td style=\"width:220.2pt\">\n			<p><img src=\"file:///C:/Users/MYCOM/AppData/Local/Temp/msohtmlclip1/01/clip_image017.jpg\" style=\"height:194px; width:259px\" /></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:220.15pt\">\n			<p><img src=\"file:///C:/Users/MYCOM/AppData/Local/Temp/msohtmlclip1/01/clip_image018.jpg\" style=\"height:170px; width:297px\" /></p>\n\n			<p>&nbsp;</p>\n			</td>\n			<td style=\"width:220.2pt\">\n			<p><img src=\