INSERT INTO `m_materi` VALUES (77, 129, 126, 3, 'RANGKAIAN LISTRIK SEARAH', '<p>RANGKAIAN LISTRIK ARUS SEARAH ( DC)</p>\n\n<p>1. Arus Listrik</p>\n\n<p>2. Hambatan Listrik</p>\n\n<p>3. Potensian Listrik</p>\n\n<p>4. Hukum Ohm</p>\n\n<p>5. Hukum Kirchoff I</p>\n\n<p>6. Susunan Hambatan</p>\n', 1, 0, 'https://www.youtube.com/embed/https://youtu.be/JyVpQvz6uEc', 'https://youtu.be/JyVpQvz6uEc', 0, '17-07-2020-1594956822-Bab_5_Lintrik_Dinamis_(Arus_Listrik,_Hambatan_Listrik,_dan_Sumber_Listrik).pdf', '17-07-2020-1594956597-Listrik_Dinamis_Kelas_XII.pptx', 1, 1, 0);
INSERT INTO `m_materi` VALUES (80, 103, 109, 3, '3.1 Induksi Matematika', '<p>Induksi Matematika</p>\n', 1, 0, 'https://www.youtube.com/embed/c10TiKu-ylc', 'https://www.youtube.com/watch?v=c10TiKu-ylc', 0, '15-07-2020-1594819605-MTKU_3_1-4_1(INDUKSI_MAT).pdf', NULL, 0, 1, 0);
INSERT INTO `m_materi` VALUES (81, 100, 102, 3, 'Teks Prosedur', '<h2>Pengertian Teks Prosedur</h2>\n\n<p>Teks Prosedur adalah teks yang berisi cara, tujuan untuk membuat atau melakukan sesuatu hal dengan langkah demi langkah yang tepat secara berurutan sehingga menghasilkan suatu tujuan yang diinginkan. Teks prosedur biasanya terdapat pada tulisan yang mengandung cara, tips atau tutorial melakukan langkah tertentu. Didalam teks prosedur terdapat kata imperatif atau kata perintah untuk melakukan apa yang dibahas pada teks agar si pembaca melakukan apa yang diperintahkan pada isi teks tersebut.</p>\n\n<p>Misalnya kamu sedang mencari tulisan cara memutihkan wajah melalui internet, nah pada teks tulisan tersebut akan ada cara atau langkah bagaimana memutihkan wajah sehingga menghasilkan putih bersih seperti yang kamu inginkan. cara yang disajikan pun langkah demi langkah secara berurutan agar sipembaca mampu mengikuti tutorial yang disajikan. ngerti ? oke lanjut. . .</p>\n\n<p>Pada&nbsp;<a href=\"https://pendidikan.co.id/teks-prosedur/\" target=\"_blank\">teks prosedur</a>, isi dari tulisannya selalu berhubungan dari awal sampai akhir, dan dari setiap isinya terdapat keterangan-keterangan agar mudah dipahami oleh pembaca.</p>\n\n<h2>Tujuan Teks Prosedur</h2>\n\n<p>Teks prosedur bertujuan untuk memudahkan pembaca maupun pendengar agar dapat mengikuti langkah atau perintah dari isi teks yang tujuan akhirnya bisa sesuai keinginan pembaca maupun pendengar.</p>\n\n<h2>Struktur&nbsp;Teks&nbsp;Prosedur</h2>\n\n<ul>\n	<li>\n	<h3>Tujuan</h3>\n	</li>\n</ul>\n\n<p>Tujuan pada teks prosedur adalah&nbsp; pengantar umum sebagai penanda apa yang akan dibuat atau dilakukan dan motivasi dalam melakukannya.</p>\n\n<ul>\n	<li>\n	<h3>Bahan dan Alat</h3>\n	</li>\n</ul>\n\n<p>Berisi mengenai rincian bahan dan alat yang digunakan dengan ukuran yang akurat.</p>\n\n<ul>\n	<li>\n	<h3>Langkah-langkah</h3>\n	</li>\n</ul>\n\n<p>Berisi langkah melakukan sesuatu dengan urut secara per tahap.</p>\n\n<ul>\n	<li>\n	<h3>Penutup</h3>\n	</li>\n</ul>\n\n<p>Berisi penekanan pada keuntungan dan ucapan selamat melakukan sesuatu.</p>\n\n<p>&nbsp;</p>\n\n<h2>Ciri Ciri Teks Prosedur</h2>\n\n<p>Adapun ciri-ciri teks prosedur yang diantaranya yaitu:</p>\n\n<ul>\n	<li>\n	<h3>Menggunakan pola kalimat perintah (imperatif).</h3>\n	</li>\n</ul>\n\n<p>Kalimat perintah&nbsp;merupakan kalimat yang mengandung makna meminta/ memerintah seseorang untuk melakukan sesuatu.</p>\n\n<p>Contoh :</p>\n\n<ol>\n	<li>Tolong matikan kran air itu!</li>\n	<li>Jangan membuat ribut, anak-anak!</li>\n	<li>Saya minta kerjakan tugasmu tepat waktu!</li>\n</ol>\n\n<ul>\n	<li>\n	<h3>Menggunakan kata kerja aktif.</h3>\n	</li>\n</ul>\n\n<p>Kata kerja yang memberikan suatu tindakan kepada objeknya misalnya :</p>\n\n<ol>\n	<li>Menyiram</li>\n	<li>Membungkus</li>\n	<li>Melempar&nbsp; dan lain &ndash; lain.</li>\n</ol>\n\n<ul>\n	<li>\n	<h3>Menggunakan kata penghubung (konjungsi) untuk mengurutkan kegiatan.</h3>\n	</li>\n</ul>\n\n<p>Kata penghubung yang menyatakan waktu kegiatan yang hadir dan bersifat kronologis.Contoh:</p>\n\n<ol>\n	<li>&ndash;Selanjutnya</li>\n	<li>&ndash;Berikutnya</li>\n	<li>&ndash;Kemudian</li>\n	<li>&ndash;Lalu</li>\n	<li>&ndash;Setelah itu.</li>\n</ol>\n\n<ul>\n	<li>\n	<h3>Menggunakan kata keterangan untuk menyatakan rinci waktu, tempat dan cara yang akurat.</h3>\n	</li>\n</ul>\n\n<p>Gunanya menambahkan atau memberi keterangan pada kata lain.</p>\n\n<p>Contoh:</p>\n\n<ol>\n	<li>Ibu mengiris lobak menggunakan pisau tajam.</li>\n	<li>inta menyiram bunga dengan tangki air miliknya.</li>\n	<li>Aku harus pergi ke rumah paman sekarang.</li>\n</ol>\n\n<ul>\n	<li>Terdapat tujuan, langkah-langkah dan penutup.</li>\n	<li>Menggunakan kalimat imperatif atau kalimat perintah sehingga pembaca bisa mengikuti apa yang diperintahkan pada sebuah teks.</li>\n	<li>Menggunakan kalimat penghubung sehingga dari awal dan akhir teks saling terkait.</li>\n	<li>Menggunakan kalimat langsung dan tidak langsung.</li>\n	<li>Menggunakan kalimat saran dan larangan.</li>\n	<li>Menggunakan kriteria atau batasan tertentu.</li>\n	<li>Menggunakan kata keterangan.</li>\n	<li>Berisi pemberian informasi.</li>\n	<li>Berisi langkah yang terperinci</li>\n	<li>Menggunakan akhiran -i dan -kan, contohnya, jangan lupa selalu siram-i bunganya setiap hari, lempar-kan bola tersebut keatas.</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h2>Macam Macam Teks Prosedur</h2>\n\n<p>Teks prosedur memiliki 3 macam jenis diantaranya, teks prosedur sederhana, kompleks dan protocol.</p>\n\n<ul>\n	<li>\n	<h3>Teks Prosedur Sederhana</h3>\n	</li>\n</ul>\n\n<p>Teks prosedur sederhana yaitu teks yang berisi langkah-langkah sederhana yang biasaya hanya 2-4 langkah saja dalam melakukannya, contohnya cara login facebook.</p>\n\n<ul>\n	<li>\n	<h3>Teks Prosedur Kompleks</h3>\n	</li>\n</ul>\n\n<p>Teks prosedur kompleks yaitu teks yang berisi banyak langkah dalam melakukannya. contohnya, cara membuat sambal balado, cara mengajukan pembuatan kartu SIM, cara memperpanjang STNK, prosedur pembuatan ktp.</p>\n\n<ul>\n	<li>\n	<h3>Teks Prosedur Protokol</h3>\n	</li>\n</ul>\n\n<p>Teks prosedur protokol adalah teks yang pada setiap langkahnya bisa diubah tidak harus runut, walaupun berubah, tetapi hasil akhirnya tetap sama. misalnya, jika memasak mie instan kita bisa merebus dengan memasukan mie dan bumbu kedalam air rebusan dari tungku atau bisa memasukan air panas kedalam wadah yang berisi mie lalu memasukan bumbu.</p>\n\n<p>&nbsp;</p>\n\n<h2>Kaidah Kebahasaan Teks Prosedur</h2>\n\n<p>Teks prosedur memiliki kaidah kebahasaan diantaranya, konjungsi temporal, kata imperatif, verba material dan tingkah laku, partisipan manusia, bilangan pendanda, kalimat introgatif dan kalimat deklaratif.</p>\n\n<ul>\n	<li>\n	<blockquote>\n	<p>Kalimat Imperatif &ndash;&nbsp;Kalimat yang mengandung perintah, fungsinya ialah untuk meminta atau melarang seseorang untuk melakukan sesuatu.</p>\n	</blockquote>\n	</li>\n</ul>\n\n<blockquote>\n<ul>\n	<li>Kalimat Deklaratif &ndash;&nbsp;Kalimat yang berisi pernyataan, fungsinya ialah untuk memberikan informasi atau berita tentang sesuatu.</li>\n</ul>\n\n<ul>\n	<li>Kalimat Interogatif &ndash;&nbsp;Kalimat yang berisi pertanyaan, fungsinya ialah untuk meminta informasi tentang sesuatu.</li>\n</ul>\n\n<ul>\n	<li>Konjungsi Temporal &ndash;&nbsp;<a href=\"https://www.gurupendidikan.co.id/konjungsi/\" target=\"_blank\">Konjungsi</a>&nbsp;temporal merupakan kata penghubung yang berhubungan secara kronologis dengan waktu dan kejadian dari kedua peristiwa yang memiliki keterkaitan. Misalnya, setelah ini, kemudian, lalu, sesudah itu, selanjutnya, sebelum itu, dan lain-lain.</li>\n</ul>\n</blockquote>\n\n<ul>\n	<li>\n	<blockquote>\n	<p>Verba material dan tingkah laku &ndash;&nbsp;Verba material adalah perbuatan yang mengacu pada tindakan, seperti potonglah ubi itu, masukan air kedalam wadah. Sedangkan Verba tingkah laku adalah perbuatan yang mengacu pada tindakan berdasarkan ungkapan, seperti, tunggu kira-kira 5 menit, tunggu sampai matang, tetap pertahankan, dan lainnya.</p>\n	</blockquote>\n	</li>\n	<li>\n	<blockquote>\n	<p>Partisipan manusia &ndash;&nbsp;Partisipan manusia adalah mempartisipasikan atau mengikutsertakan manusia dalam tulisan tersebut untuk membantu langkah-langkahnya.</p>\n	</blockquote>\n	</li>\n	<li>\n	<blockquote>\n	<p>Bilangan penanda &ndash;&nbsp;Bilangan penanda adalah bilangan yang mengurutkan langkah-langkah pada tulisannya.</p>\n	</blockquote>\n	</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h2>Contoh Teks Prosedur Kiat Berwawancara Kerja Beserta Strukturnya</h2>\n\n<p>&nbsp;</p>\n\n<p><a href=\"https://www.gurupendidikan.co.id/wp-content/uploads/2019/10/Contoh-Teks-Prosedur-Kiat-Berwawancara-Kerja.jpg\" target=\"_blank\"><img alt=\"Contoh-Teks-Prosedur-Kiat-Berwawancara-Kerja\" src=\"https://www.gurupendidikan.co.id/wp-content/uploads/2019/10/Contoh-Teks-Prosedur-Kiat-Berwawancara-Kerja.jpg\" style=\"height:327px; width:547px\" /></a></p>\n\n<blockquote>\n<p>Bagi perusahaan, wawancara merupakan kesempatan untuk menggali kualifkasi calon pegawai secara lebih mendalam, melihat kecocokannya dengan posisi yang ditawarkan, kebutuhan dan sifat perusahaan. Wawancara pun menjadi ajang tanya jawab antara pewawancara dengan calon. Agar mudah dipahami oleh mitra bicara, kita harus berbicara dengan jelas. Jaga agar kita tidak berbicara terlalu cepat atau lambat, atur juga suara agar jelas terdengar. Suara yang terlalu pelan membuat kita terlihat kurang percaya diri, sementara suara yang terlalu keras membuat kita terlihat agresif. Penggunaan bahasa yang baik juga menjadi suatu keharusan.</p>\n\n<hr /></blockquote>\n\n<blockquote>\n<p>Selain itu, perhatikan betul apa yang disampaikan pewawancara agar kita dapat memerikan jawaban yang relevan. Tak ada salahnya menanyakan kembali atau mencoba mengulangi pertanyaan yang diajukan untuk memastikan bahwa pemahaman kita sudah benar. Namun, jangan melakukannya terlalu sering karena justru akan membuat pewawancara mempertanyakan daya tangkap kita. Bahasa tubuh pun ikut memegang peranan. Gerakan nonverbal seperti mengangguk atau sikap tubuh yang agak condong ke depan menunjukkan bahwa kita tertarik pada apa yang disampaikan si pewawancaraa. Pastikan pula kita menjaga kontak mata dengan pewawancara, karena kontak mata penting dalam proses komunikasi, termasuk dalam wawancara kerja.</p>\n\n<hr />\n<p>Singkatnya, akan lebih baik jika kita mampu menampilkan sikap yang antusias secara verbal maupun nonverbal. Oleh karena itu, hindari bahasa tubuh yang dapat diartikan negatif, seperti menggoyangkan kaki, mengetuk-ngetuk jari, atau menghindari kontak mata. Cara berbicara yang percaya diri namun tidak terkesan sombong dapat menarik minat pewawancara.</p>\n\n<p>Pada saat berbicara, hindari uraian yang panjang lebar dan berteletele. Cobalah mengemas kalimat secara singkat dan terfokus, namun tetap menarik. Kita diharapkan mampu menunjukkan bahwa kita adalah orang yang tepat untuk posisi yang ditawarkan. Ceritakanlah kemampuan atau pengalaman yang relevan dengan posisi tersebut. Hindari mengkritik atasan atau rekan kerja sebelumnya karena ini menunjukkan sikap yang tidak professional.</p>\n\n<hr />\n<p>Selama wawancara berlangsung, jadilah diri sendiri. Ungkapan ini mungkin terdengar klise, namun jauh lebih baik menjadi diri sendiri dan berbicara dengan jujur, daripada mencoba mengatakan sesuatu yang menurut kita akan membuat pewawancara merasa terkesan. Jangan melebih-lebihkan kualifkasi kita, apalagi mengelabui dengan memberikan data yang tidak benar. Cepat atau lambat, pewawancara akan menemukan bahwa data tersebut hanyalah karangan. Tunjukkan bahwa kita mampu mengenali diri kita sendiri dengan tepat.</p>\n\n<hr />\n<p>Pewawancara biasanya memberikan kesempatan kepada kita untuk mengajukan pertanyaan di akhir wawancara. Gunakanlah kesempatan ini secara elegan dengan cara menunjukkan rasa ingin tahu kita tentang lingkup dan deskripsi tugas posisi yang dilamar, kesempatan pengembangan diri, dan sebagainya. Ini wajar, karena bersikap pasif dan menyerahkan segala sesuatu kepada pihak perusahaan tidak akan menambah nilai kita di mata pewawancara.</p>\n\n<hr />\n<p>Calon yang mau bertanya dalam porsi yang tepat menunjukkan kesungguhan minatnya pada posisi yang ditawarkan dan juga pada perusahaan. Di sesi ini biasanya muncul pula pembicaraan mengenai gaji dan tunjangan. Pewawancara sangat menghargai kandidat yang mampu menentukan nominal gaji yang ia harapkan, karena dianggap dapat melakukan penilaian atas kemampuannya dan tugas-tugas yang akan dilakukan. Tentu saja angkanya harus logis sambil tetap membuka kesempatan untuk negosiasi. Dengan persiapan matang dan unjuk diri yang baik saat wawancara, kita telah meninggalkan kesan yang layak untuk dipertimbangan oleh perusahaan.</p>\n\n<p>(Sumber: &ldquo;Unjuk Diri yang Baik dalam Wawancara Kerja&rdquo; dalam Kompas dengan pengubahan).</p>\n</blockquote>\n\n<hr />\n<ul>\n	<li>\n	<blockquote>\n	<p>Struktur Teks Prosedur</p>\n	</blockquote>\n	</li>\n</ul>\n\n<blockquote>\n<p>Teks prosedur dibentuk oleh ungkapan tentang tujuan, langkah-langkah, dan penegasan ulang.</p>\n\n<p>1. Tujuan merupakan pengantar tentang topik yang akan dijelaskan dalam teks. Pada contoh teks berjudul &ldquo;Kiat Berwawancara Kerja&rdquo;, pendahuluan yang dimaksud berupa pengertian wawancara dan manfaat bagi suatu perusahaan (paragraf 1).</p>\n\n<p>2. Langkah-langkah berupa perincian petunjuk yang disarankan kepada pembaca terkait dengan topik yang ditentukan (paragraf 2-9)</p>\n\n<p>3. Penegasan ulang berupa harapan ataupun manfaat apabila petunjukpetunjuk itu dijalankan dengan baik (paragraf 10)</p>\n</blockquote>\n\n<blockquote>\n<p>&nbsp;</p>\n</blockquote>\n\n<p><a href=\"https://www.gurupendidikan.co.id/wp-content/uploads/2019/10/Struktur-Teks-Prosedur.jpg\" target=\"_blank\"><img alt=\"Struktur-Teks-Prosedur\" src=\"https://www.gurupendidikan.co.id/wp-content/uploads/2019/10/Struktur-Teks-Prosedur.jpg\" style=\"height:131px; width:400px\" /></a></p>\n\n<ul>\n	<li>Unsur Kebahasaan Teks Prosedur</li>\n</ul>\n\n<ol>\n	<li>Banyak menggunakan kata-kata kerja perintah (imperatif). Kata kerja imperatif dibentuk oleh akhiran&nbsp;<em>&ndash;kan, -i,&nbsp;</em>dan partikel&nbsp;<em>&ndash;lah.</em></li>\n</ol>\n\n<table>\n	<tbody>\n		<tr>\n			<td>Bentuk dasar</td>\n			<td>Imbuhan/Partikel</td>\n			<td>Bentukan Kata</td>\n		</tr>\n		<tr>\n			<td>perhati</td>\n			<td>-kan</td>\n			<td>perhatikan</td>\n		</tr>\n		<tr>\n			<td>pasti</td>\n			<td>-kan</td>\n			<td>pastikan</td>\n		</tr>\n		<tr>\n			<td>tunjuk</td>\n			<td>-kan</td>\n			<td>tunjukkan</td>\n		</tr>\n		<tr>\n			<td>cerita</td>\n			<td>-kan</td>\n			<td>ceritakan</td>\n		</tr>\n		<tr>\n			<td>hindar</td>\n			<td>-i</td>\n			<td>hindari</td>\n		</tr>\n		<tr>\n			<td>jadi</td>\n			<td>-lah</td>\n			<td>jadilah</td>\n		</tr>\n	</tbody>\n</table>\n\n<ol>\n	<li>Banyak menggunakan kata-kata teknis yang berkaitan dengan topikyang dibahasnya. Apabila teks tersebut berkenaan dengan masalah komunikasi, akan digunakan istilah-istilah komunikasi pula, misalnya&nbsp;<em>tanya jawab, kontak mata, pewawancara, verbal, nonverbal, bahasa tubuh,&nbsp;</em>dan&nbsp;<em>negosiasi.</em></li>\n</ol>\n\n<ol>\n	<li>Banyak menggunakan konjungsi dan partikel yang bermakna penambahan, seperti&nbsp;<em>selain itu, pun, kemudian, selanjutnya, oleh karena itu, lalu, setelah itu,&nbsp;</em>dan<em>&nbsp;di samping itu.</em></li>\n</ol>\n\n<ol>\n	<li>Banyak menggunakan pernyataan persuasif. Berikut adalah contoh kalimatnya.</li>\n</ol>\n\n<ul>\n	<li>Penggunaan bahasa yang baik juga menjadi keharusan.</li>\n	<li>Singkatnya, akan lebih baik bila kita mampu menampilkan sikap yang antusias, verbal, maupun nonverbal</li>\n</ul>\n\n<ol>\n	<li>Apabila prosedur itu berupa resep dan petunjuk penggunaan alat, akan digunakan gambaran terperinci tentang benda dan alat yang dipakai, termasuk ukuran, jumlah, dan warna.</li>\n</ol>\n\n<p>&nbsp;</p>\n\n<p><a href=\"https://www.gurupendidikan.co.id/wp-content/uploads/2019/10/Unsur-Kebahasaan-Teks-Prosedur.jpg\" target=\"_blank\"><img alt=\"Unsur-Kebahasaan-Teks-Prosedur\" src=\"https://www.gurupendidikan.co.id/wp-content/uploads/2019/10/Unsur-Kebahasaan-Teks-Prosedur.jpg\" style=\"height:234px; width:400px\" /></a></p>\n\n<hr />\n<blockquote>\n<h2>Contoh Teks Prosedur&nbsp;Cara Mendirikan Tenda Kemah</h2>\n\n<p>&nbsp;</p>\n</blockquote>\n\n<p><a href=\"https://www.gurupendidikan.co.id/wp-content/uploads/2019/10/Contoh-Teks-Prosedur-Cara-Mendirikan-Tenda-Kemah.jpg\" target=\"_blank\"><img alt=\"Contoh-Teks-Prosedur-Cara-Mendirikan-Tenda-Kemah\" src=\"https://www.gurupendidikan.co.id/wp-content/uploads/2019/10/Contoh-Teks-Prosedur-Cara-Mendirikan-Tenda-Kemah.jpg\" style=\"height:358px; width:574px\" /></a></p>\n\n<p>Ada beberapa jenis tenda yang dapat digunakan dalam kegiatan kepramukaan, tetapi untuk kegiatan berkemah yang baik, tenda yang digunakan hendaknya merupakan tenda standar yang mendirikannya dengan menggunakan tali dan patok. Hal ini untuk melatih keterampilan dan ketangkasan anggotanya dalam kegiatan berkemah tersebut.</p>\n\n<p>Berikut ini cara mendirikan tenda yang benar dan baik dalam kegiatan berkemah pramuka yaitu :</p>\n\n<ol>\n	<li>\n	<blockquote>\n	<p>Periksa, bersihkan dan amankan terlebih dahulu area atau wilayah tempat yang akan dipasangi tenda</p>\n	</blockquote>\n	</li>\n	<li>\n	<blockquote>\n	<p>Persiapan perlengkapan dan peralatan untuk memasang tenda seperti ; tenda, tiang, patok, tali, palu kecil, dll.</p>\n	</blockquote>\n	</li>\n	<li>\n	<blockquote>\n	<p>Buka lembaran tenda untuk mengetahui besarnya dan tentukan arah dan sudut tenda.</p>\n	</blockquote>\n	</li>\n	<li>\n	<blockquote>\n	<p>Pasang tiang tenda sesuai posisinya, dalam hal ini pada sudut-sudut tenda yang bersangkutan.</p>\n	</blockquote>\n	</li>\n	<li>\n	<blockquote>\n	<p>Tancapkan patok-patok pada tiap sudut tenda dan pintu tenda.</p>\n	</blockquote>\n	</li>\n	<li>\n	<blockquote>\n	<p>Setelah menegakan tiang tongkat, ambil tali, lalu ikatkan pada patok yang sudah tertancap di tanah.</p>\n	</blockquote>\n	</li>\n	<li>\n	<blockquote>\n	<p>Begitupun dengan tiang depan, ikatkan talinya. (Alangkah lebih bagus jika menggunakan tali ganda).</p>\n	</blockquote>\n	</li>\n	<li>\n	<blockquote>\n	<p>Pasang pendukung tenda, seperti, lampu, pagar, gerbang dan lain sebagainya.</p>\n	</blockquote>\n	</li>\n</ol>\n\n<hr />\n<p>Demikianlah pembahasan mengenai&nbsp;&ldquo;Teks Prosedur&rdquo; Pengertian &amp; ( Tujuan &ndash; Macam &ndash; Ciri &ndash; Contoh )&nbsp;semoga dengan adanya ulasan tersebut dapat menambah wawasan dan pengetahuan anda semua, terima kasih banyak atas kunjungannya.</p>\n\n<hr />\n<p>Rujukan</p>\n\n<p>Suherli, dkk. 2017.&nbsp;<em>Buku Siswa Bahasa Indonesia Kelas X</em><em>I</em><em>&nbsp;Revisi&nbsp;</em>&nbsp;<em>Tahun 2017</em>. Jakarta: Pusat Kurikulum dan Perbukuan, Balitbang, Kemendikbud.</p>\n\n<p>Suherli, dkk.&nbsp;<em>Buku Guru Bahasa Indonesia Kelas X</em><em>I</em><em>&nbsp;Revisi&nbsp;</em>&nbsp;<em>Tahun 2017</em>. Jakarta: Pusat Kurikulum dan Perbukuan, Balitbang, Kemendikbud.</p>\n\n<p>Kosasih, E. 2014.&nbsp;<em>Jenis-Jenis Teks dalam Mata Pelajaran Bahasa Indoneisa SMA/MA/SMK</em>. Bandung: Yrama Widya</p>\n', 1, 0, 'https://www.youtube.com/embed/hhtps://youtu.be/FY1m56fh9YU', 'hhtps://youtu.be/FY1m56fh9YU', 0, NULL, '16-07-2020-1594856423-Teks_Prosedur_XI.pptx', 0, 1, 0);
