INSERT INTO `m_materi` VALUES (98, 156, 143, 2, 'Pertemuan Pertama (Perkenalan diri)', '<p>Assalamualaikum,,,selamat pagi anak-anaku, mudah-mudahan selalu dalam lindungan allah swt.&nbsp;</p>\n\n<p>Pertama-tama ibu ucapkan selamat, atas kenaikan kelas menjadi kelas XI mudah-mudahan semangat belajar kalian semakin meningkat. Seperti yang kita ketahui, ditengah&nbsp;pandemi ini mau tidak mau, kita dituntut&nbsp;untuk belajar dari rumah untuk itu pada pembelajaran Seni Budaya dan Keterampilan, kita akan menggunakan beberapa media selain LMS sekolah, yaitu :&nbsp;</p>\n\n<p>1. Whatapp Grup (Berfungsi sebagai informasi dan arahan pembelajaran yang akan kita lakukan disetiap minggunya, selain itu silahkan yang berkaitan dengan mata pelajaran berupa tugas harian dll).&nbsp;</p>\n\n<p>2. IG (Fungsi IG dalam pembelajaran SBK sebagai pengumpulan Tugas VIdeo/hasil karya seni yang telah diciptakan, beserta dengan caption/konsep karya)&nbsp;</p>\n\n<p>3. Email (berfungsi sebagai media dalam mengumpulkan tugas berupa Word/pdf/ppt dll).</p>\n\n<p>4. ZOOM (Pembelajaran Tatap Muka)</p>\n\n<p>Untuk itulah diharapkan setiap siswa bergabung pada grup SBK KLS XI. (info lebih lanjut)</p>\n\n<p>Adapun Kontak yang Bisa kalian Hubungi :</p>\n\n<p><strong>WA : 081809425528</strong></p>\n\n<p><strong>IG :&nbsp;Rqurotalayuni</strong></p>\n\n<p><strong>email : 1206ayuni@gmail.com&nbsp;</strong></p>\n\n<p>Ada pepatah mengatakan <em>&quot;tak kenal maka tak sayang&quot;&nbsp;</em>untuk itulah perkenalkan Nama ibu Rani Qurotal Ayuni, Ibu mengajar mata pelajaran Seni budaya dan Keterampilan (Seni Rupa). (info lebih lanjut Via ZOOM).</p>\n\n<p>sekian dari ibu, tetap &#39;&#39;<em>stay home&#39;&#39;&nbsp;</em>dan jangan lupa gunakan protokol kesehatan. Assalamualaikum Wr Wb!</p>\n', 1, 0, '1', '1', 0, NULL, NULL, 1, 0, 0);
