INSERT INTO `m_soal_penilaian` VALUES (21, 3, 0, 1.00000000, '', '', '<p>Apakah dosen menyampaikan materi perkuliahan sudah menggunakan rujukan akademik yang jelas ?</p>\r\n', '#####<p>Sesuai daftar referensi di dalam RPS/Modul/Paket Instruksi dan ada tambahan buku lain.</p>\r\n', '#####<p>Sesuai daftar referensi di dalam RPS/Modul/Paket Instruksi.</p>\r\n', '#####<p>Ada dan relevan meskipun tidak sesuai daftar referensi di dalam RPS/Modul/Paket Instruksi.</p>\r\n', '#####<p>Ada sebagian tapi kurang relevan</p>\r\n', '#####<p>Tidak ada dan tidak merujuk.</p>\r\n', 'A', '2020-06-11 04:35:31', 0, 0);
INSERT INTO `m_soal_penilaian` VALUES (22, 3, 0, 1.00000000, '', '', '<p>Bagaimana dosen menyampaikan materi perkuliahan menggunakan slide paparan ?</p>\r\n', '#####<p>Menarik, jelas dan ditambah cuplikan film.</p>\r\n', '#####<p>Menarik dan jelas.</p>\r\n', '#####<p>Menarik tapi kurang jelas.</p>\r\n', '#####<p>Tidak menarik dan tidak jelas.</p>\r\n', '#####<p>Tanpa slide.</p>\r\n', 'A', '2020-06-11 04:37:39', 0, 0);
INSERT INTO `m_soal_penilaian` VALUES (23, 3, 0, 1.00000000, '', '', '<p>Bagaimana kemampuan dosen menyampaikan materi perkuliahan ?</p>\r\n', '#####<p>Menarik, sistematis dan menguasai materi.</p>\r\n', '#####<p>Menarik dan jelas.</p>\r\n', '#####<p>Menarik tapi tidak jelas.</p>\r\n', '#####<p>Tidak menarik dan tidak jelas.</p>\r\n', '#####<p>Seadanya.</p>\r\n', 'A', '2020-06-11 04:39:17', 0, 0);
INSERT INTO `m_soal_penilaian` VALUES (24, 3, 0, 1.00000000, '', '', '<p>Apakah dosen memberikan aplikasi ilmu dengan kehidupan nyata atau medan penugasan sepanjang perkuliahan berlangsung ?</p>\r\n', '#####<p>Mengkaitkan dengan situasi dan kondisi nyata kedinasan yang dihadapi secara tepat.</p>\r\n', '#####<p>Membahas sesuai permasalahan yang kontekstual.</p>\r\n', '#####<p>Memberi contoh aplikasi tapi kurang relevan.</p>\r\n', '#####<p>Sesekali memberi contoh aplikasi.</p>\r\n', '#####<p>Tidak memberi contoh sama sekali.</p>\r\n', 'A', '2020-06-11 04:41:01', 0, 0);
INSERT INTO `m_soal_penilaian` VALUES (25, 3, 0, 1.00000000, '', '', '<p>Apakah dosen memberikan inspirasi baru atau ide-ide penelitian untuk menyusun tesis atau Taskap ?</p>\r\n', '#####<p>Membuka wawasan pengetahuan baru.</p>\r\n', '#####<p>Memberi perspektif dan cara pandang baru.</p>\r\n', '#####<p>Memberi paradigma atau topik penelitian.</p>\r\n', '#####<p>Kurang inspiratif.</p>\r\n', '#####<p>Tidak memberi inspirasi.</p>\r\n', 'A', '2020-06-11 04:44:09', 0, 0);
INSERT INTO `m_soal_penilaian` VALUES (26, 3, 0, 1.00000000, '', '', '<p>Bagaimana kemampuan dosen meningkatkan gairah belajar Perwira Mahasiswa/Perwira Siswa dan suasana akademis ?</p>\r\n', '#####<p>Menjadi lebih rajin pinjam buku perpustakaan.</p>\r\n', '#####<p>Lebih sering berdiskusi dengan temannya.</p>\r\n', '#####<p>Lebih rajin mencari materi tambahan.</p>\r\n', '#####<p>Tidak terjadi perubahan.</p>\r\n', '#####<p>Gairah belajar malah menurun.</p>\r\n', 'A', '2020-06-11 05:04:02', 0, 0);
INSERT INTO `m_soal_penilaian` VALUES (27, 3, 0, 1.00000000, '', '', '<p>Bagaimana kemampuan dosen meningkatkan rasa keingintahuan akademis Perwira Mahasiswa/Perwira Siswa ?</p>\r\n', '#####<p>Menjadi sering menghadiri ujian proposal atau ujian tesis rekannya.</p>\r\n', '#####<p>Mencari teori-teori dan konsep-konsep baru dari buku atau jurnal.</p>\r\n', '#####<p>Membaca tesis-tesis angkatan sebelumnya.</p>\r\n', '#####<p>Tidak terjadi perubahan.</p>\r\n', '#####<p>Keingintahuan malah berkurang.</p>\r\n', 'A', '2020-06-11 05:04:58', 0, 0);
INSERT INTO `m_soal_penilaian` VALUES (28, 3, 0, 1.00000000, '', '', '<p>Bagaimana kemampuan dosen meningkatkan kebanggaan sebagai Peserta Didik Seskoal ?</p>\r\n', '#####<p>Meningkatkan rasa nasionalisme dan patriotisme.</p>\r\n', '#####<p>Tumbuh semangat bela negara.</p>\r\n', '#####<p>Aktif di kelas dan senat.</p>\r\n', '#####<p>Tidak terjadi perubahan perilaku.</p>\r\n', '#####<p>Kebanggaan malah menurun.</p>\r\n', 'A', '2020-06-11 05:05:52', 0, 0);
INSERT INTO `m_soal_penilaian` VALUES (29, 3, 0, 1.00000000, '', '', '<p>Bagaimana kemampuan dosen meningkatkan prestasi akademik ?</p>\r\n', '#####<p>Lebih aktif menulis artikel ilmiah untuk jurnal nasional terakreditasi atau jurnal internasional bereputasi.</p>\r\n', '#####<p>Aktif mengikuti lomba-lomba penulisan artikel ilmiah atau call of paper.</p>\r\n', '#####<p>Aktif menghadiri seminar.</p>\r\n', '#####<p>Tidak terjadi perubahan prestasi.</p>\r\n', '#####<p>Prestasi malah menurun.</p>\r\n', 'A', '2020-06-11 05:07:07', 0, 0);
INSERT INTO `m_soal_penilaian` VALUES (30, 3, 0, 1.00000000, '', '', '<p>Bagaimana dosen menggunakan alokasi waktu sesuai jadwal perkuliahan ?</p>\r\n', '#####<p>Tepat sesuai jadwal dan memberikan diskusi/tanya-jawab.</p>\r\n', '#####<p>Relatif masih sesuai jadwal.</p>\r\n', '#####<p>Terlambat dari jadwal.</p>\r\n', '#####<p>Tidak sesuai jadwal.</p>\r\n', '#####<p>Ada perubahan waktu tanpa ada pemberitahuan.</p>\r\n', 'A', '2020-06-11 05:08:02', 0, 0);
INSERT INTO `m_soal_penilaian` VALUES (31, 3, 0, 1.00000000, '', '', '<p>Bagaimana dosen menggunakan bahasa pengantar selama perkuliahan ?</p>\r\n', '#####<p>Kombinasi bahasa Indonesia dan bahasa Inggris.</p>\r\n', '#####<p>Kombinasi bahasa Indonesia dengan sedikit terminologi bahasa Inggris.</p>\r\n', '#####<p>Hanya bahasa Indonesia baku.</p>\r\n', '#####<p>Bahasa Indonesia tidak baku.</p>\r\n', '#####<p>Artikulasi tidak jelas.</p>\r\n', 'A', '2020-06-11 05:09:06', 0, 0);
INSERT INTO `m_soal_penilaian` VALUES (32, 3, 0, 1.00000000, '', '', '<p>Bagaimana interaksi sosial dosen selama perkuliahan dan/atau di luar perkuliahan ?</p>\r\n', '#####<p>Ramah dan bersemangat.</p>\r\n', '#####<p>Ramah dan humoris.</p>\r\n', '#####<p>Ramah tapi kurang bersemangat.</p>\r\n', '#####<p>Kurang ramah.</p>\r\n', '#####<p>Tidak bersemangat.</p>\r\n', 'A', '2020-06-11 05:09:59', 0, 0);
INSERT INTO `m_soal_penilaian` VALUES (33, 3, 0, 1.00000000, '', '', '<p>Bagaimana mutu tugas dan kuis yang diberikan dosen ?</p>\r\n', '#####<p>Relevan dengan materi kuliah menjawab pertanyaan.</p>\r\n', '#####<p>Memacu pemahaman atas materi kuliah.</p>\r\n', '#####<p>Kontekstual materi kuliah.</p>\r\n', '#####<p>Kurang relevan dengan materi kuliah.</p>\r\n', '#####<p>Tidak memberi tugas atau kuis.</p>\r\n', 'A', '2020-06-11 05:12:16', 0, 0);
INSERT INTO `m_soal_penilaian` VALUES (34, 3, 0, 1.00000000, '', '', '<p>Bagaimana mutu UAS dan UTS yang diberikan dosen ?</p>\r\n', '#####<p>Relevan dengan pemecahan masalah.</p>\r\n', '#####<p>Relevan dengan materi kuliah.</p>\r\n', '#####<p>Relevan dengan tugas dan kuis.</p>\r\n', '#####<p>Kurang relevan dengan materi kuliah.</p>\r\n', '#####<p>Tidak relevan dengan materi kuliah.</p>\r\n', 'A', '2020-06-11 05:13:43', 0, 0);
INSERT INTO `m_soal_penilaian` VALUES (35, 3, 0, 1.00000000, '', '', '<p>Bagaimana personifikasi dosen ?</p>\r\n', '#####<p>Rapi berpakaian sesuai ketentuan seragam yang berlaku.</p>\r\n', '#####<p>Rapi berpakaian tidak sesuai ketentuan.</p>\r\n', '#####<p>Rapi berpakaian tapi tidak gunakan atribut.</p>\r\n', '#####<p>Busana kurang sesuai dengan kombinasi warna.</p>\r\n', '#####<p>Melanggar ketentuan seragam.</p>\r\n', 'A', '2020-06-11 05:16:15', 0, 0);
INSERT INTO `m_soal_penilaian` VALUES (36, 3, 0, 1.00000000, '', '', '<p>Sejauh mana peran dosen mendampingi praktek kuliah di luar Seskoal, KKDN dan KKLN ?</p>\r\n', '#####<p>Aktif dan menguasai materi objek yang dikunjungi.</p>\r\n', '#####<p>Aktif tapi kurang menguasai materi.</p>\r\n', '#####<p>Memang tidak ikut KKDN dan KKLN.</p>\r\n', '#####<p>Kurang aktif membimbing.</p>\r\n', '#####<p>Tidak menguasai materi.</p>\r\n', 'A', '2020-06-11 05:17:13', 0, 0);
INSERT INTO `m_soal_penilaian` VALUES (37, 3, 0, 1.00000000, '', '', '<p>Bagaimana peran dosen dalam latihan Opsgab/Opsma dan latihan lainnya ?</p>\r\n', '#####<p>Aktif dan menguasai konteks latihan sesuai materi perkuliahan.</p>\r\n', '#####<p>Aktif tapi kurang memahami Buku I, Buku II A dan Buku II B.</p>\r\n', '#####<p>Memang tidak ikut latihan.</p>\r\n', '#####<p>Aktif tapi kurang memahami produk yang dihasilkan.</p>\r\n', '#####<p>Kurang aktif menjalankan peran yang ada.</p>\r\n', 'A', '2020-06-11 05:18:20', 0, 0);
INSERT INTO `m_soal_penilaian` VALUES (38, 3, 0, 1.00000000, '', '', '<p>Bagaimana peran dosen dalam aplikasi simulasi penyusunan produk-produk latihan/produk-produk kebijakan ?</p>\r\n', '#####<p>Aktif dan menguasai konteks aplikasi sesuai materi perkuliahan.</p>\r\n', '#####<p>Aktif tapi kurang memahami Rencana Garis Besar (RGB).</p>\r\n', '#####<p>Memang tidak ikut aplikasi.</p>\r\n', '#####<p>Aktif tapi kurang memahami produk yang dihasilkan.</p>\r\n', '#####<p>Kurang aktif menjalankan peran yang ada.</p>\r\n', 'A', '2020-06-11 05:20:43', 0, 0);
INSERT INTO `m_soal_penilaian` VALUES (39, 3, 0, 1.00000000, '', '', '<p>Bagaimana peran dosen dalam kegiatan forum strategi dan seminar/FGD/diskusi panel ?</p>\r\n', '#####<p>Aktif dan menguasai tahapan kegiatan sesuai materi perkuliahan.</p>\r\n', '#####<p>Aktif tapi kurang memahami Term Of References (TOR).</p>\r\n', '#####<p>Memang tidak ikut forum.</p>\r\n', '#####<p>Aktif tapi kurang memahami produk yang dihasilkan.</p>\r\n', '#####<p>Kurang aktif menjalankan peran yang ada.</p>\r\n', 'A', '2020-06-11 05:22:11', 0, 0);
