INSERT INTO `tb_komen_materi` VALUES (177, 65, 24, 0, 1154, 'Kubus merupakan bangun ruang yang dibatasi oleh 6 bujur sangkar, keenam bujur sangkar tersebut disebut sisi kubus, dan garis yang menjadi perpotongan dua sisi kubus disebut rusuk kubus. Kubus memiliki 12 rusuk yang sama panjang. Selain itu kubus mempunyai rumus, yang pertama volume yaitu V=s³, Dan yang kedua merupakan rumus Luas permukaan yaitu L= 6s²', NULL, '2020-07-15', '08:47:13', NULL, NULL);
