INSERT INTO `tb_komen_materi` VALUES (181, 65, 24, 0, 1147, 'Kubus adalah salah satu bangun ruang 3 dimensi yang memiliki sifat sebagai berikut\r\na. Memiliki 6 sisi yang ukuran dan modelnya sama. \r\nb. Memiliki 12 rusuk yang ukurannya sama. \r\nc. Memiliki 8 buah titik sudut yang sama besar (90°)\r\nd. Memiliki ukuran s x s x s\r\ne. Memiliki diagonal sisi 2\r\nf. Memiliki diagonal ruang 4\r\ng. Memiliki bidang diagonal 6\r\n\r\nRumus-rumus kubus :\r\n• Luas permukaan :\r\n6 . s^2\r\n• Volume kubus:\r\ns . s . s\r\n• Diagonal Sisi\r\nsV2\r\n• Diagonal Sisi Seluruhnya\r\n12 . sV2\r\n• Diagonal Ruang\r\nsV3\r\n• Diagonal Ruang Seluruhnya\r\n4 . sV3\r\n• Luas Bidang Diagonal\r\ns^2 V2\r\n• Luas Bidang Diagonal Seluruhnya\r\n6 . s^2 V2\r\nContoh benda:\r\ndadu, rubik, lemari es', NULL, '2020-07-15', '08:48:32', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (182, 65, 0, 0, 1142, 'Kubus adalah bangun ruang yang berbentuk persegi dan mempunyai 6 sisi, 12 rusuk, dan 8 titik sudut.', '0', '2020-07-15', '08:48:33', NULL, NULL);
