INSERT INTO `tb_komen_materi` VALUES (194, 65, 24, 0, 1129, 'kubus adalah bangun ruang yang memiliki enam sisi yang semua sisinya berbentuk persegi dan memiliki 12 rusuk yang semua rusuknya sama panjang.\nrumus:\n1. Luas persegi = r x r\n2. V = r3\n3. Luas permukaan kubus= 6 x r2', NULL, '2020-07-15', '08:50:33', '2020-07-15', '08:58:38');
