INSERT INTO `tb_komen_materi` VALUES (198, 65, 24, 0, 1130, 'Kubus adalah bangun ruang 3 dimensi yang terdiri atas 6 sisi berbentuk bujur sangkar dengan jumlah 12 rusuk yang panjangnya sama, dan 8 titik sudut. Kubus memiliki volume (rumus : sisi^3) dan luas permukaan (rumus: 6s^2)', NULL, '2020-07-15', '08:53:59', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (200, 65, 24, 0, 1124, 'Kubus adalah bangun ruang yang dibatasi oleh enam sisi yang berbentuk persegi, mempunyai enam sisi yang berukuran sama, delapan titik sudut, dan 12 rusuk yang sama panjang', NULL, '2020-07-15', '08:54:12', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (201, 65, 24, 0, 1150, 'Kubus adalah bangun ruang yang memiliki tiga dimensi yang sudah dibatasi oleh enam bidang sisi-sisinya yang berbentuk kongruen. Kubus memiliki 6 buah sisi, 12 buah rusuk, 8 buah titik sudut. ', NULL, '2020-07-15', '08:54:51', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (202, 65, 24, 0, 1143, 'kubus adalah bangun ruang yang memiliki 12 rusuk sama panjang. (v = s^3) (L = 6.s^2)', NULL, '2020-07-15', '08:55:31', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (203, 65, 24, 0, 1152, 'Kubus adalah bangun ruang tiga dimensi yang dibatasi oleh enam bidang sisi yang kongruen berbentuk bujur sangkar. Kubus memiliki 6 sisi, 12 rusuk, dan 8 titik sudut. Kubus juga disebut dengan bidang enam beraturan, selain itu kubus juga merupakan bentuk khusus dalam prisma segi empat, Kubus.\n\nSifat-Sifat Kubus :\n1. Semua sisi kubus berbentuk persegi\n2. Semua rusuk kubus beukuran sama panjang\n3. Setiap diagonal bidang pada kubus memiliki ukuran yang sama panjang.\n4. Setiap diagonal ruang pada kubus memiliki ukuran yang sama panjang.\n5. Setiap bidang diagonal pada kubus memiliki bentuk persegi panjang.\n\nRumus Pada Kubus\n\n1.Luas Permukaan\nL : 6.S^2\n2.Volume\nV : S^3\n3.Keliling\nK : 12.S\n4.Diagonal Bidang/sisi\nDs: S akar 2\n5.Diagonal Bidang/sisi seluruhnya\nDss : 12. S akar 2\n6.Diagonal Ruang\nDr : S akar 3\n7.Diagonal Ruang\nDrr : 4. S akar 3\n8.Luas Bidang Diagonal\nBd : S^2 akar 2\n9.Luas Bidang Diagonal seluruhnya\nBdd: 6. S^2 akar 2\n\nKeterangan:\nS : rusuk atau sisi.', NULL, '2020-07-15', '08:55:32', '2020-07-15', '09:03:38');
INSERT INTO `tb_komen_materi` VALUES (228, 65, 0, 0, 1126, 'Kubus adalah bangun ruang tiga dimensi yang dibatasi oleh enam bidang sisi yang kongruen berbentuk bujur sangkar. Kubus memiliki 6 sisi, 12 rusuk, dan 8 titik sudut.Semua rusuk kubus berukuran sama panjang.', '0', '2020-07-15', '08:56:22', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (229, 65, 24, 0, 1139, 'Kubus adalah bangun ruang, memiliki 3 dimensi yaitu tinggi,panjang lebar, memiliki 6 sisi berbentuk persegi dan memiliki 12 rusuk. Rumus volume kubus yaitu panjang x tinggi x lebar', NULL, '2020-07-15', '08:57:50', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (230, 65, 24, 0, 1128, 'Kubus adalah bangun ruang tiga dimensi yang memimiliki 6 sisi, 8 sudut, dan 12 rusuk sama panjang.', NULL, '2020-07-15', '08:58:14', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (231, 65, 0, 0, 1148, 'kubus Memiliki 12 rusuk yang sama panjang.\r\nkubus Memiliki 12 diagonal sisi yang sama panjang.\r\nkubus Memiliki 4 diagonal ruang.', '0', '2020-07-15', '08:58:59', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (232, 31, 0, 0, 781, 'Ahmad Hanif Izzaturrahman (01)', '0', '2020-07-15', '08:59:05', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (234, 65, 24, 0, 1149, 'Kubus merupakan bangun ruang yang dibatasi oleh 6 bujur sangkar yang saling kongruen. Keenam bujur sangkar disebut sisi kubus dan garis yang menjadi perpotongan dua sisi kubus disebut rusuk kubus.Luas permukaan kubus = 6.r2\nVolume kubus = r3\n\nKeliling Kubus = 12 x rusuk\nLuas salah satu sisi = rusuk x rusuk\nUnsur-unsur pada kubus\n(1) Rusuk (12 buah)\n(2) Bidang sisi (6 buah)\n(3) Titik sudut (8 buah)\n(4) Diagonal sisi (12 buah)\n(5) Diagonal ruang (4 buah)\n(6) Bidang diagonal ( 6 buah)\nKubus adalah bangun ruang tiga dimensi yang dibatasi oleh enam bidang sisi yang kongruen berbentuk bujur sangkar. Kubus juga disebut dengan Bidang enam beraturan, selain itu kubus juga merupakan bentuk khusus dalam prisma segi empat, Kubus.\nSifat-Sifat Kubus\nSemua sisi kubus berbentuk persegi\nSemua rusuk kubus beukuran sama panjang\nSetiap diagonal bidang pada kubus memiliki ukuran yang sama panjang.\nSetiap diagonal ruang pada kubus memiliki ukuran yang sama panjang.\nSetiap bidang diagonal pada kubus memiliki bentuk persegi panjang.\nJaring-Jaring Kubus\nJaring-Jaring adalah bidang datar yang berupa gabungan dari bangun datar yang membentuk sebuah bangun ruang seperti kubus, balok, limas dan lain sebagainya. Jaring-jaring bisa didapatkan dengan cara membagi sebuah bangun ruang dengan mengikuti rusuk-rusuknya.\nBidang Diagonal\nBidang diagonal sebuah kubus adalah bidang yang melalui dua rusuk yang berhadapan. Kubus mempunyai enam bidang diagonal yang berbentuk persegi panjang yang kongruen.', NULL, '2020-07-15', '09:00:42', '2020-07-15', '09:05:46');
INSERT INTO `tb_komen_materi` VALUES (235, 31, 0, 0, 791, 'gilang nandirasari (11)', '0', '2020-07-15', '09:00:44', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (236, 65, 24, 0, 1153, '								Kubus adalah bangun ruang yang dibatasi oleh 6 bujur sangkar yang saling kongruen. Keenam bujur sangkar disebut sisi kubus dan garis yang menjadi perpotongan dua sisi kubus disebut rusuk kubus. Kubus memiliki 12 rusuk yang sama panjang.\r\nVolume kubus=s^3\r\nLuas permukaan=6xs^2', NULL, '2020-07-15', '09:02:09', NULL, NULL);
