INSERT INTO `tb_komen_materi` VALUES (238, 65, 24, 0, 1136, 'Kubus merupakan bangun ruang yang dibatasi oleh bujur sangkar yang saling kongruen. Keenam bujur sangkar disebut kubus dan garis yang jadi potongan dua sisi kubus adalah rusuk kubus. Rusuk kubus ada 12 sama panjang.\r\n								Volume kubus\r\nV=s^3\r\n\r\nLuas permukaan\r\nL=6.s^2\r\n								. Kubus memiliki 6 sisi, 12 rusuk, 8 titik sudut. Kubus merupakan bentuk khusus dalam prisma segi empat																				\r\n							\r\n										\r\n							\r\n										\r\n							\r\n										', NULL, '2020-07-15', '09:04:19', NULL, NULL);
