INSERT INTO `tb_komen_materi` VALUES (446, 63, 349, 0, 829, '\r\nWa\'alaikumussalam,siang juga pak!\r\nCara menentukan dhp:\r\n1.Gambarkan persamaan garis dengan mengubah tanda pertidaksamaan dengan tanda sama dengan.\r\n2.Tetapkan satu titik sebagai acuan dan lakukan uji titik.\r\n3.Jika Pertidaksamaan dan persamaan garis tidak diketahui, tetapi titik potong sumbu x dan titik potong sumbu y diketahui, \r\n4.Penyelesaian dari suatu sistem pertidaksamaan linear adalah irisan dari penyelesaian pertidaksamaan-pertidaksamaan pembentuk sistem pertidaksamaan tersebut.', NULL, '2020-07-15', '11:31:44', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (467, 63, 349, 0, 827, 'Waalaikummusalam, dengan langkah-langkah sebagai berikut:\r\n1. Gambarkan persamaan garis dengan mengubah tanda pertidaksamaan dengan tanda sama dengan. Kemudian cari titik potong sumbu x (y = 0) dan\r\ntitik potong sumbu y (x = 0), kemudian tarik garis melalui kedua titik tersebut.\r\n2. Tetapkan satu titik sebagai acuan misalkan titik O(0, 0) dan lakukan uji titik O(0, 0). Substitisikan titik O(0, 0) kedalam pertidaksamaan. Jika benar, maka arsiran harus kearah O(0, 0) karena O(0, 0) adalah salah satu penyelesaian. Jika salah, maka arah arsiran haruslah ke arah sebaliknya karena titik O(0, 0) bukan salah satu penyelesaian. Disamping uji titik, kita bisa menentukan daerah arsiran berdasarkan koefisien dari x atau koefisien dari y. Misalkan pertidaksamaannya adalah \r\na\r\nx\r\n+\r\nb\r\ny\r\n>\r\nc\r\n, maka persamaan garis yang diperoleh dari pertidaksamaan adalah \r\na\r\nx\r\n+\r\nb\r\ny\r\n=\r\nc\r\n.\r\n?\r\n Jika a > 0 dan tanda pertidaksamaan \r\n?\r\n \r\na\r\nt\r\na\r\nu\r\n \r\n>\r\n, maka daerah arsirannya adalah sebelah kanan garis dan jika tanda pertidaksamaannya \r\n?\r\n \r\na\r\nt\r\na\r\nu\r\n \r\n<\r\n, maka daerah arsirannya adalah sebelah kiri garis. Jika a < 0, berlaku sebaliknya.\r\n?\r\n Jika b > 0 dan tanda pertidaksamaannya \r\n?\r\n \r\na\r\nt\r\na\r\nu\r\n \r\n>\r\n, maka daerah arsirannya adalah sebelah atas garis, dan jika tanda pertidaksamaannya \r\n?\r\n \r\na\r\nt\r\na\r\nu\r\n \r\n<\r\n daerah arsirannya adalah sebelah bawah garis. Jika b < 0, berlaku sebaliknya.\r\n3. Jika Pertidaksamaan dan persamaan garis tidak diketahui, tetapi titik potong sumbu x dan titik potong sumbu y diketahui, misalkan garis\r\nmemotong sumbu y di (0, a) dan sumbu x dititik (b, 0), maka persamaan garisnya adalah \r\na\r\nx\r\n+\r\nb\r\ny\r\n=\r\na\r\nb\r\n.\r\n4. Penyelesaian dari suatu sistem pertidaksamaan linear adalah irisan dari penyelesaian pertidaksamaan-pertidaksamaan pembentuk sistem pertidaksamaan tersebut.', NULL, '2020-07-15', '11:33:31', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (468, 63, 349, 0, 820, 'Waalaikumsalam pak..selamat siang..Cara untuk melukis DHP dari suatu grafik adalah:\r\n1.Pahami pertidaksamaan yang \r\n   diberikan\r\n2.Cari komponen x dan y dari \r\n   pertidaksamaan yang diberikan \r\n   kemudian gambar titik-titiknya\r\n3.Hubungkan titik tersebut \r\n   sehingga membentuk grafik\r\n4.Setelah grafik digambar,uji coba \r\n   salah satu titik koordinat yang \r\n   bukan merupakan titik dari \r\n   pertidaksamaan awal\r\n5.Apabila setelah menguji salah \r\n   satu titik ternyata memenuhi \r\n   syarat pertidaksamaan awal tsb\r\n   (misal,0<1) maka DHP dari \r\n    pertidaksamaan tersebut atau \r\n   daerah yang harus diarsir,arah \r\n   arsirannya mengikuti arah titik \r\n   yang diuji dari grafik dari \r\n   pertidaksamaan yang \r\n   berikan.Apabila ternyata titik \r\n   yang diuji tidak mengikuti syarat \r\n   pertidaksamaann maka daerah\r\n   yang diarsir arahnya berlawanan \r\n   dengan arah titik uji dari grafik \r\n   tsb.\r\n   ', NULL, '2020-07-15', '11:33:41', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (481, 63, 349, 0, 814, '1. Gambarkan persamaan garis dengan mengubah tanda pertidaksamaan dengan tanda sama dengan. Kemudian cari titik potong sumbu x (y = 0) dan\r\ntitik potong sumbu y (x = 0), kemudian tarik garis melalui kedua titik tersebut.\r\n\r\n2. Tetapkan satu titik sebagai acuan misalkan titik O(0, 0) dan lakukan uji titik O(0, 0). Substitisikan titik O(0, 0) kedalam pertidaksamaan. Jika benar, maka arsiran harus kearah O(0, 0) karena O(0, 0) adalah salah satu penyelesaian. Jika salah, maka arah arsiran haruslah ke arah sebaliknya karena titik O(0, 0) bukan salah satu penyelesaian. Disamping uji titik, kita bisa menentukan daerah arsiran berdasarkan koefisien dari x atau koefisien dari y. Misalkan pertidaksamaannya adalah \r\nax+by>c, maka persamaan garis yang diperoleh dari pertidaksamaan adalah \r\nax+by=c.\r\n Jika a > 0 dan tanda pertidaksamaan ?atau>, maka daerah arsirannya adalah sebelah kanan garis dan jika tanda pertidaksamaannya ?atau<, maka daerah arsirannya adalah sebelah kiri garis. Jika a < 0, berlaku sebaliknya.\r\n Jika b > 0 dan tanda pertidaksamaannya\r\n ? atau >, maka daerah arsirannya adalah sebelah atas garis, dan jika tanda pertidaksamaannya ? atau < daerah arsirannya adalah sebelah bawah garis. Jika b < 0, berlaku sebaliknya.\r\n\r\n3. Jika Pertidaksamaan dan persamaan garis tidak diketahui, tetapi titik potong sumbu x dan titik potong sumbu y diketahui, misalkan garis\r\nmemotong sumbu y di (0, a) dan sumbu x dititik (b, 0), maka persamaan garisnya adalah ax+by=ab.\r\n\r\n4. Penyelesaian dari suatu sistem pertidaksamaan linear adalah irisan dari penyelesaian pertidaksamaan-pertidaksamaan pembentuk sistem pertidaksamaan tersebut.', NULL, '2020-07-15', '11:35:42', NULL, NULL);
