INSERT INTO `tb_komen_materi` VALUES (520, 63, 349, 0, 825, '1. Gambarlah garis ax + by = c pada bidang cartesius dengan cara mencari titik-titik potong grafik dengan sumbu x (y = 0) dan sumbu y (x = 0).\r\n\r\n2. Ambil titik sembarang P(x1, y1) yang bukan terletak pada garis tersebut, kemudian dihitung nilai dari ax1 + by1. Nilai ax1 + by1 ini dibandingkan dengan nilai c.\r\n\r\n3. Daerah penyelesaian untuk pertidaksamaan ax + by < c ditentukan sebagai berikut :\r\nJika ax1 + by1 < c, maka daerah yang memuat P merupakan daerah penyelesaian.\r\nJika ax1 + by1 > c, maka daerah yang memuat titik P bukan merupakan daerah penyelesaian.\r\n4. Daerah penyelesaian untuk petidaksamaan ax + by > c ditentukan sebagai berikut :\r\nJika ax1 + by1 > c, maka daerah yang memuat P merupakan daerah penyelesaian.\r\nJika ax1 + by1 < c, maka daerah yang memuat titik P bukan merupakan daerah penyeleasian.\r\n5. Daerah yang bukan merupakan penyelesaian diberi arsiran, sehingga daerah penyelesaiannya merupakan daerah tanpa arsiran. Hal ini sangat membantu pada saat menentukan daerah yang memenuhi terhadap beberapa pertidaksamaan.\r\n6. Daerah penyelesaian untuk pertidaksamaan yang memuat tanda sama dengan digambar dengan garis penuh, sedangkan daerah penyelesaian pertidaksamaan yang tidak memuat tanda sama dengan digambar dengan garis putus-putus.', NULL, '2020-07-15', '11:38:43', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (532, 63, 349, 0, 840, '1. gambar terlebih dahulu pertidaksamaan nya yang berupa grafik dengan mengubah tanda ke taksammaanya menjadi =\r\n2. pilih satu titik sembarang yang tidak di aluri garis, kemudian subtitusi ke pertidaksamaan nya, jika titik tersebut memenuhi pertidaksamaan nya, maka daerah yang memuat titik yang di uji tersebut adalah DHP nya, jika titik uji tidak memenuhi pertifaksamaan maka DHP nya adalah daerah yang tidak membuat titik tersebut.\r\n3. beri tanda dhp yang berupa arisan', NULL, '2020-07-15', '11:38:56', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (541, 63, 349, 0, 818, ' Cara menentukan DHP:\r\n1. Gambarlah garis ax + by = c pada bidang cartesius dengan cara mencari titik-titik potong grafik dengan sumbu x (y = 0) dan sumbu y (x = 0).\r\n\r\n2. Ambil titik sembarang P(x1, y1) yang bukan terletak pada garis tersebut, kemudian dihitung nilai dari ax1 + by1. Nilai ax1 + by1 ini dibandingkan dengan nilai c.\r\n\r\n3. Daerah penyelesaian untuk pertidaksamaan ax + by < c ditentukan sebagai berikut :\r\n\r\n    Jika ax1 + by1 < c, maka daerah yang memuat P merupakan daerah penyelesaian.\r\n    Jika ax1 + by1 > c, maka daerah yang memuat titik P bukan merupakan daerah penyelesaian.\r\n\r\n4. Daerah penyelesaian untuk petidaksamaan ax + by > c ditentukan sebagai berikut :\r\n\r\n    Jika ax1 + by1 > c, maka daerah yang memuat P merupakan daerah penyelesaian.\r\n    Jika ax1 + by1 < c, maka daerah yang memuat titik P bukan merupakan daerah penyeleasian.\r\n\r\n5. Daerah yang bukan merupakan penyelesaian diberi arsiran, sehingga daerah penyelesaiannya merupakan daerah tanpa arsiran. Hal ini sangat membantu pada saat menentukan daerah yang memenuhi terhadap beberapa pertidaksamaan.\r\n\r\n6. Daerah penyelesaian untuk pertidaksamaan yang memuat tanda sama dengan digambar dengan garis penuh, sedangkan daerah penyelesaian pertidaksamaan yang tidak memuat tanda sama dengan digambar dengan garis putus-putus.', NULL, '2020-07-15', '11:39:14', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (562, 63, 349, 0, 845, 'Cara:1.Gambarkan persamaan garis dengan mengubah tanda pertidaksamaan dengan tanda sama dengan.\r\n\r\n2.Tetapkan satu titik sebagai acuan dan lakukan uji titik.\r\n\r\n3.Jika Pertidaksamaan dan persamaan garis tidak diketahui, tetapi titik potong sumbu x dan titik potong sumbu y diketahui, \r\n\r\n4.Penyelesaian dari suatu sistem pertidaksamaan linear adalah irisan dari penyelesaian pertidaksamaan-pertidaksamaan pembentuk sistem pertidaksamaan tersebut.', NULL, '2020-07-15', '11:42:06', NULL, NULL);
