INSERT INTO `tb_komen_materi` VALUES (568, 63, 349, 0, 834, 'Waalaikumsallam\r\n\r\nCara mencari DHP dapat dilakukan dengan cara:\r\n1.Cari titik dengan mencari nilai X dan Y\r\n2.Mencari X dan Y dapat dibikin 0 salah satunya, jika ingin mencari X maka Y=0 Begitu pun sebaliknya\r\n3.Lalu Gambar di grafik sesuai dengan nilai X dan Y\r\n4.Lalu uji coba dengan titik dengan titik yang bukan grafik titik pertidaksamaan, jika hasil memenuhi pertidaksamaan maka arsiran mendekati dari titik uji. Namun jika hasil tidak memenuhi pertidaksamaan maka arsiran menjauhi titik uji\r\n\r\ncontohnya terlampir', 'assets/materi/diskusi/3041188e77b1e19ac14b0811f65dfdf4.PNG', '2020-07-15', '11:46:36', NULL, NULL);
