INSERT INTO `tb_komen_materi` VALUES (573, 63, 349, 0, 824, 'walaikumsalam,Metode Uji sembarang titik Langkah-langkah Menentukan DHP nya yaitu dengan cara : Gambarlah terlebih dahulu pertidaksamaannya (berupa grafik) dengan mengubah tanda ketaksamaannya (>,?,?,<) menjadi = ii). Pilih satu titik sembarang yang tidak dilalui oleh garis, kemudian substitusi ke pertidaksamaannya. Jika titik tersebut memenuhi pertidaksamaan, maka daerah yang memuat titik yang diuji tersebut adalah DHP nya. Jika titik yang diuji tidak memenuhi pertidaksamaan, maka DPH nya adalah daerah yang tidak memuat titik tersebut. iii). Beri tanda DHP nya berupa arsiran. Metode sistem Pertidaksamaan Daerah himpunan penyelesaian dari sistem pertidaksamaan adalah daerah penyelesaian (DHP) yang memenuhi semua pertidaksamaan yang ada. Langkah-langkah menentukan DHP nya : 1). Gambar masing-masing grafik pertidaksamaan dan tentukan DHP nya. 2). Tandai DHP nya. Ada dua cara untuk menandai DHP nya yaitu : i). DHP nya ditandai dengan daerah arsiran, maksudnya kita arsir daerah yang benar dan kita cari daerah yang terkena arsiran paling banyak dan itulah DHP nya. Terapi, cara ini kurang efektif karena kita terkadang mengalami kesulitan untuk menentukan daerah mana yang terkena arsiran yang paling banyak apalagi kita hanya menggunakan satu warna untuk mengarsirnya. ii). DHP nya daerah yang bersih, maksudnya kita arsir daerah yang salah dan setelah semua pertidaksamaan kita selesaikan kemudian kita cari daerah yang bersih, daerah tersebutlah DHP nya.', NULL, '2020-07-15', '11:47:23', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (574, 63, 349, 0, 826, 'Siang Pak\r\nHimpunan titik (x, y) atau himpunan penyelesaian dari sistem pertidaksamaan linear bisa digambarkan pada sistem koordinat Cartesius dengan cara : \r\n1. Gambar persamaan garis dengan mengubah tanda pertidaksamaan dengan tanda sama dengan. Kemudian cari titik potong sumbu x (y = 0) dan titik potong sumbu y (x = 0), lalu tarik garis melalui kedua titik tersebut.\r\n2. Pilih satu titik sebagai acuan misalnya titik O(0, 0) dan lakukan uji titik O(0, 0). Substitisikan titik O(0, 0) kedalam pertidaksamaan. Kalau benar, maka arsiran harus kearah O(0, 0) karena O(0, 0) adalah salah satu penyelesaian. Kalau salah, maka arah arsiran haruslah ke arah berlainan karena titik O(0, 0) bukan salah satu penyelesaian. Setelah uji titik, kita bisa menentukan daerah arsiran berdasarkan koefisien dari x atau koefisien dari y. Misalnya pertidaksamaannya adalah ax+by>c,maka persamaan garis yang diperoleh dari pertidaksamaan adalah  ax+by=c.', NULL, '2020-07-15', '11:48:02', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (576, 63, 569, 108, 0, 'Jawaban diskusi diupload ya.', NULL, '2020-07-15', '11:49:07', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (577, 63, 349, 0, 835, 'Siang juga pak, untuk langkah2 atau cara menentukan DHP, jawaban saya adalah sebagai berikut : \r\n1. Gambarlah terlebih dahulu pertidaksamaannya berupa grafik dengan mengubah tanda ketaksamaannya (>,?,?,<) menjadi = .\r\n2. Pilih satu titik sembarang yang tidak dilalui oleh garis, kemudian substitusi ke pertidaksamaannya. Apabila ternyata titik tersebut memenuhi pertidaksamaan, maka daerah yang memuat titik yang diuji tersebut adalah DHP nya. Tapi apabila titik yang diuji tidak memenuhi pertidaksamaan, maka DPH nya adalah daerah yang tidak memuat titik tersebut. \r\n3. Beri tanda DHP nya berupa arsiran.\r\nSekian, terima kasih pak.', NULL, '2020-07-15', '11:50:41', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (578, 63, 349, 0, 1309, 'Waalaikumsalam wr. Wb, pertama-tama gambar masing - masing grafik pertidaksamaan dan tentukan DHP nya dengan cara menentukan titik potong terhadap sumbu - sumbu yang terdapat pada persamaan. Lalu, kita dapat mengambil sembarang titik uji , semisalnya kita dapat mengambil titik uji (0,0), lalu kita subtitusikan pada persamaan, dan kita lihat apakah benar atau tidak hasil persamaannya. Lalu lukislah atau gambar hasil dari grafik tersebut. Tandai DHP nya dengan cara diarsir, bisa dengan mengarsir daerah yang salah,lalu daerah yang bersih lah DHP nya, bisa juga dilakukan kebalikannya', NULL, '2020-07-15', '11:54:02', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (580, 63, 349, 0, 821, '1. cari unsur x dan y dengan mengganti salah satu x dan y menjadi 0 (mencari titik potong)\r\n2. uji tiap-tiap pertidaksamaan dengan titik (0,0)\r\n3. jika hasil uji benar ( contoh 0<8 ), maka beri arsir pada bagian luar garis yg jauh dari titik 0,0\r\n4. jika hasil uji salah ( contoh 0>8 ), maka beri arsir pada bagian dalam garis yang dekat dengan titik 0,0\r\n5. setelah semua pertidaksamaan diuji dan diarsir, maka DHP nya adalah bagian yang bersih dari arsiran (tidak diarsir)\r\n\r\ncatatan : hasil uji salah yang diarsir', NULL, '2020-07-15', '11:55:32', NULL, NULL);
