INSERT INTO `tb_komen_materi` VALUES (585, 63, 349, 0, 836, 'Wa\'alaikumsalam pak, untuk cara menentukan DHP yaitu sebagai berikut:\r\n1. Gambarlah garis ax + by = c pada bidang cartesius dengan cara mencari titik-titik potong grafik dengan sumbu x (y = 0) dan sumbu y (x = 0). 2. Ambil titik sembarang P(x1, y1) yang bukan terletak pada garis tersebut, kemudian dihitung nilai dari ax1 + by1. Nilai ax1 + by1 ini dibandingkan dengan nilai c. 3. Daerah penyelesaian untuk pertidaksamaan ax + by < c ditentukan sebagai berikut : Jika ax1 + by1 < c, maka daerah yang memuat P merupakan daerah penyelesaian. Jika ax1 + by1 > c, maka daerah yang memuat titik P bukan merupakan daerah penyelesaian. 4. Daerah penyelesaian untuk petidaksamaan ax + by > c ditentukan sebagai berikut : Jika ax1 + by1 > c, maka daerah yang memuat P merupakan daerah penyelesaian. Jika ax1 + by1 < c, maka daerah yang memuat titik P bukan merupakan daerah penyeleasian. 5. Daerah yang bukan merupakan penyelesaian diberi arsiran, sehingga daerah penyelesaiannya merupakan daerah tanpa arsiran. Hal ini sangat membantu pada saat menentukan daerah yang memenuhi terhadap beberapa pertidaksamaan. 6. Daerah penyelesaian untuk pertidaksamaan yang memuat tanda sama dengan digambar dengan garis penuh, sedangkan daerah penyelesaian pertidaksamaan yang tidak memuat tanda sama dengan digambar dengan garis putus-putus.', NULL, '2020-07-15', '12:13:40', NULL, NULL);
INSERT INTO `tb_komen_materi` VALUES (586, 63, 0, 0, 837, 'Pertama mencari DHP adalah merubah setiap variabel menjadi garis titik sumbu lalu mencari hasil dari uji titik (0,0) pada setiap garis setelah itu mengarsir garis yang salah dan mencari hasil yang bersih pada setiap arsiran garis ', '0', '2020-07-15', '12:18:28', NULL, NULL);
